'—Ç–≤–æ—è –º–∞—Ç—å –ø–æ—Å—Ç—Ä–æ–∏–ª –æ–±–æ—Ä–æ–Ω—É –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –Ω–æ —Å –∫–∞–∂–¥—ã–º —É–¥–∞—Ä–æ–º –ø–æ —Å—Ç–µ–Ω–∞–º —ç—Ç–æ–π –æ–±–æ—Ä–æ–Ω—ã —è –≤—Å—ë –±–ª–∏–∂–µ –∫ –≥–ª–æ—Ç–∫–µ —Ç–≤–æ–µ–π –º–∞—Ç—É—Ö–µ //üå¥üçÅ',
'–º–æ–π —Ö—É–π —É–∂–µ –Ω–∞ —Å—Ç–æ–ª—å–∫–æ –≤—ã—Ä–æ—Å –≤ –≥–ª–∞–∑–∞—Ö —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —á—Ç–æ –æ–Ω–∞ —Å–æ—Å—ë—Ç –µ–≥–æ –º–µ—Å—Ç–æ –∑–∞–≤—Ç—Ä–∞–∫–∞ //üå¥üçÅ',
'—Ä–∞–∑–º—É—Ä–æ–≤–∞–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º –∫–æ–≥–¥–∞ –æ–Ω–∞ –Ω–µ –º–æ–≥–ª–∞ –≤—ã–±—Ä–∞—Ç—å—Å—è –∏–∑ –∑–∞ —á–µ–≥–æ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –ø–æ –∂–∏–∑–Ω–µ–Ω–æ –º–Ω–µ –¥–æ–ª–∂–Ω–∞ –æ—Ç—Å–∞—Å—ã–≤–∞—Ç—å –∞ –ø–æ—Ç–æ–º —Ç—ã –µ—ë —Å–º–µ–Ω–∏—à—å –ø—Ä–∞–≤–¥–∞ –∂–µ //üå¥üçÅ',
'–Ω–∞–∫–∏–Ω—É–ª —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –≤ –∫–∞–±–∏–Ω—É –∑–∞ —Ç–æ —á—Ç–æ –æ–Ω–∞ —Ä–µ—à–∏–ª–∞ –æ—Å–∏–ª–∏—Ç—å –º–æ–π —Ö—É–π —Å–≤–æ–∏–º —Ä—Ç–æ–º –ø—É—Å—Ç—å —Ç–∞–∫–∞—è —à–∞–≤–∫–∞ –¥–∞–∂–µ –Ω–µ –ø–∏—Ç–∞–µ—Ç –Ω–∞–¥–µ–∂–¥—ã //üå¥üçÅ',
