'–º—ã –ø–æ—Å–ø–æ—Ä–∏–ª–∏ —Å –æ—Ç—Ü–æ–º —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ —Å–æ—Å–∞–ª–∞ –º–Ω–µ –Ω–µ –±–æ–ª—å—à–µ 200 —Ä–∞–∑ –≤ –¥–µ–Ω—å –Ω–æ –æ–Ω –ø—Ä–æ–∏–≥—Ä–∞–ª –≤–µ–¥—å —É–≤–∏–¥–µ–ª –∫–∞–∫ –æ–Ω–∞ –æ—Ç—Å–∞—Å—ã–≤–∞–µ—Ç –º–Ω–µ –≤ –∂–∏–≤—É—é //üå¥üçÅ',
'—Ç–≤–æ—é –º–∞—Ç—å –ø–µ—Ä–≤—ã–π —Ä–∞–∑ –∑–∞ –∫—É—Å–æ–∫ —Å–∞–ª–æ –≤—ã–µ–±–∞–ª –∞ –æ–Ω–∞ —Ä–∞–¥–æ–≤–∞–ª–∞—Å—å —á—Ç–æ –º–æ–∂–µ—Ç –Ω–∞–∫–æ—Ä–º–∏—Ç—å —Ç–µ–±—è –Ω–æ –∫–∞–∫ –ø–æ–µ–ª —Å–ª–∏–∑–µ–Ω—å //üå¥üçÅ',
'–ø–æ–ø—Ä–æ–±—É–π –µ—â—ë —Ä–∞—Å —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –ø–µ—Ä–µ–≤–µ–¥–∞–ª–∞ —Å—Ç–æ–ª—å–∫–æ –∫–ª—ë–≤—ã—Ö —Ö—É—ë–≤ —è —Ç–µ–±—è —É–µ–±—É —Ö—É—ë–º –≤–µ–¥—å –æ–Ω–∞ –Ω–∞ –æ—Ç—Å–æ—Å–µ –ø—Ä–∏–∑–Ω–∞–≤–∞–ª—Å—å —á—Ç–æ –º–æ–π —Ö—É–π —Å–∞–º—ã–π –ª—É—á—à–∏–π //üå¥üçÅ',
'–ø–æ –∑–≤–µ—Ä—Å–∫–∏ —Ç–≤–æ—é –º–∞—Ç—å –µ–±—É –æ–Ω–∞ –≤ —à–æ–∫–µ –∏ –¥—É–º–∞–µ—Ç —á—Ç–æ —ç—Ç–æ –ª—é–±–æ–≤—å –Ω–æ —è –ø—ã—Ç–∞—é—Å—å –≤–∫–∞—á–∞—Ç—å –µ—ë —Å–ø–µ—Ä–º–∞–∫–æ–º —á—Ç–æ–±—ã –æ–Ω–∞ –ø–µ—Ä–µ–¥–æ–∑–Ω—É–ª–∞—Å—å //üå¥üçÅ',
'–Ω—É –∏ —á—ë –º—ã —Ç–µ–ø–µ—Ä—å —Å —Ç–≤–æ–∏–º –±–∞—Ç–µ–π –¥—Ä—É–∑—å—è –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —è –¥–∞–ª —Ç–≤–æ–µ–π –º–∞–º–∞—à–∫–µ –Ω–∞ –∫–ª—ã–∫ –æ–Ω —É–∑–Ω–∞–ª —á—Ç–æ –æ–Ω–∞ –∂–∞–ª–∫–∞—è —à–ª—é—Ö–∞ –∏ —Å–¥–∞–ª –µ—ë –º–Ω–µ –≤ —Ä–∞–±—Å—Ç–≤–æ //üå¥üçÅ',
'—Ç–≤–æ—è –º–∞—Ç—å —Å–Ω–∞—á–∞–ª–∞ –¥—É–º–∞–ª–∞ —á—Ç–æ –º–æ–π —Ö—É–π –Ω–µ –≤—ã–∑—ã–≤–∞–µ—Ç –∑–∞–≤–∏—Å–∏—Å–º–æ—Å—Ç –Ω–æ —Å –∫–∞–∂–¥—ã–º —Ä–∞–∑–æ–º —Å–æ—Å–∞–ª–∞ –≤—Å—ë –±–æ–ª—å—à–µ –∏ –±–æ–ª—å—à–µ //üå¥üçÅ',
'–Ω–∞ —Ä–∞–∑–æ–≥—Ä–µ–≤ —Ç–≤–æ—é –º–∞–º–∞—à—É –ø–æ–µ–±–∞–ª –∞ –ø–æ—Ç–æ–º —Ç–≤–æ–π –±–∞—Ç—è —Ä–µ—à–∏–ª –º–Ω–µ –ø–æ —Ñ–∞–Ω—É –æ—Ç—Å–æ—Å–∞—Ç—å —è —Ç–µ–ø–µ—Ä—å –¥—É–º–∞—é —É –≤–∞—Å –≤—Ä–æ–∂–¥—ë–Ω–æ–µ –º–æ–π —Ö—É–π —Å–æ—Å–∞—Ç—å //üå¥üçÅ',
'–º–æ–π —Ö—É–π –ø—Ä–æ—à—ë–ª—Å—è –ø–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –æ—Ç –Ω–∞—á–∞–ª–∞ –∏ –¥–æ –∫–æ–Ω—Ü–∞ –∏ —Ç—ã –¥–æ–ª–∂–µ–Ω –±—ã—Ç—å –±–ª–∞–≥–æ–¥–∞—Ä–µ–Ω—å —á—Ç–æ –º–æ–π —Ö—É–π –æ—Å—Ç–∞–≤–∏–ª –µ—ë –æ–±–ª–∏—Ç–æ–π —Å–ø–µ—Ä–º–∞–∫–æ–º –∞ –Ω–µ —Ä–∞–∑–º–∞—Ç–∞–ª //üå¥üçÅ',
