'–Ω—É —â–∞—Å —è –Ω–∞—á–Ω—É –∫—Ä—É—Ç–∏—Ç—å —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞ —Ö—É–µ –±–µ–∑ –æ—Å—Ç–∞–Ω–æ–≤–∫–∏ –∞ —Ç—ã –ø–æ—Ä–æ–±—É–π –æ—Å—Ç–∞–Ω–æ–≤–∏—Ç—å —ç—Ç—É –∫–∞—Ä—É—Å–µ–ª—å –∂–∞–ª–∫–∏–π —Ç–æ–ª—å–∫–æ —Å–º–æ—Ç—Ä–∏ —Å–∞–º –Ω–µ –ø–æ–ø–∞–¥–∏ –Ω–∞ –Ω–µ—ë //üå¥üçÅ',
'—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –µ—Å—Ç—å –∫–æ—Ä–æ–Ω–∫–∞ –∫–æ–≥–¥–∞ —Å–æ–±–∏—Ä–∞—é—Ç—å—Å—è —Ä–æ–¥—Å—Ç–≤–µ–Ω–∏–∫–∏ –∏ –ø—Ä–æ—Å—è—Ç –ø–æ–∫–∞–∑–∞—Ç—å —á–µ–≥–æ –æ–Ω–∞ –¥–æ—Å—Ç–∏–≥–ª–∞ –æ–Ω–∞ –∑–æ–≤—ë—Ç –º–µ–Ω—è –∏ —Å–æ—Å—ë—Ç –º–æ–π —Ö—É–π –∏ –≤—Å–µ –∞–ø–ª–∞–¥–∏—Ä—É—é—Ç –ø—Ä–∏–∫–∏–Ω—å //üå¥üçÅ',
