'–¥–∞–∂–µ –Ω–∞–∫—É—Ä–µ–Ω—ã–º —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –æ–Ω–∞ –¥—É–º–∞–ª–∞ —á—Ç–æ —è –ø—Ä–æ—Å—Ç–æ —Ä–∞–¥ –µ—ë –≤–∏–¥–µ—Ç—å –Ω–æ –∫–æ–≥–¥–∞ –º–µ–Ω—è –∫—Ä—ã–ª–æ —è –ø—Ä–µ–¥—Å—Ç–∞–≤–ª—è–ª —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ —Å–ø–∏–¥–æ–∑–Ω–∞—è –∏ –º–Ω–µ —Å—Ç–∞–Ω–æ–≤–∏–ª–∞—Å—å –ª–µ–≥—á–µ //üå¥üçÅ',
'—Ç–≤–æ—è –º–∞—Ç—å —Ä–µ—à–∏–ª–∞ –∑–∞—Å–Ω—è—Ç—å –∫–∞–∫ —è –µ—ë –µ–±—É –ø–æ—Ç–æ–º —Å–∫–∏–Ω—É–ª–∞ –¥—Ä—É–∑—å—è–º –æ–Ω–∏ —Å–º–æ—Ç—Ä–µ–ª–∏ –≤—Å–µ –≤–∏–¥–æ—Å—ã –∏ –ø–æ—Ç–æ–º —Ä–µ—à–∏–ª–∏ —á—Ç–æ –º–æ–π —Ö—É–π –Ω–∞–¥–æ –ø–∏–∞—Ä–∏—Ç—å –≤ —Ç–≤–æ–µ–π –≥–ª–æ—Ç–∫–µ –µ–∑ –µ–∑ //üå¥üçÅ',
'–∫–æ–≥–¥–∞ —è —É–º–∏—Ä–∞–ª –Ω–∞ –¥–≤–∏–∂–µ —Ç–≤–æ—è –º–∞—Ç—å —Å–¥–µ–ª–∞–ª–∞ –º–Ω–µ –≥–æ—Ä–ª–æ–≤–æ–π –º–∏–Ω—å–µ—Ç –∏ –º–Ω–µ —Å—Ç–∞–ª–æ —Ç–∞–∫ –ª–µ–≥—á–µ —á—Ç–æ —è –Ω–∞—á–∞–ª –≤–æ–∑—Ä–æ–∂–¥–∞—Ç—å—Å—è –æ—Å–º–æ—Ç—Ä–µ–ª—Å—è –≤–æ–∫—Ä—É–≥ –∞ –æ–∫–∞–∑–∞–ª—Å—è –Ω–∞ —Ä–µ–π–≤–µ //üå¥üçÅ',
'–≤–∫–∞—á–∞–ª —Ç–≤–æ–µ–≥–æ –æ—Ç—Ü–∞ —Ö—É—ë–º –∏ –º–æ–≥—É –¥–∞–∂–µ —Å —á–∏—Å—Ç–æ–π —Å–æ–≤–µ—Å—Ç—å—é —Å–∫–∞–∑–∞—Ç—å —á—Ç–æ —Ç–≤–æ–π –æ—Ç–µ—Ü –∫–∞–∫ –º–æ–≥ –ø—ã—Ç–∞–ª—Å—è –º–Ω–µ –æ—Ç—Å–æ—Å–∞—Ç—å –Ω–æ –æ–Ω –ø–æ–ª—É—á–∏–ª –º–Ω–æ–≥–æ—á–∏—Å–ª–µ–Ω–Ω—ã–π —É—Ä–æ–Ω –æ—Ç –º–æ–µ–≥–æ —Ö—É—è //üå¥üçÅ',
'–∫–æ–≥–¥–∞ —è —Å–µ–ª –≤ —Ç—é—Ä—å–º—É —Ç–≤–æ—è –º–∞—Ç—å –±–µ–≥–∞–ª–∞ –∫–æ –º–Ω–µ –Ω–∞ –∫–∏—á—É –∏ –æ—Ç—Å–∞—Å—ã–≤–∞–ª–∞ –∫–∞–∫ –±–µ—à–µ–Ω–∞—è —è –Ω–∞—á–∞–ª –∫–æ—Ä–º–∏—Ç—å –µ—ë –ª–µ—â–∞–º–∏ –ø–æ—Ç–æ–º—É —á—Ç–æ –∫–∞–∫ –æ–Ω–∞ –≤–æ–±—â–µ –∑–∞–±—Ä–∞–ª–∞—Å—å –≤ –∫–∞–º–µ—Ä—É //üå¥üçÅ',
'–Ω–µ –∫–æ–≥–¥–∞ –Ω–µ –ø–æ–π–º—É –æ–¥–Ω–æ–≥–æ –∑–∞—á–µ–º —Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫ –æ–±–∏–ª—å–Ω–æ —Å–æ—Å—ë—Ç –∏ –∫ —á–µ–º—É –æ–Ω–∞ —Å—Ç—Ä–µ–º–∏—Ç—å—Å—è –º–æ–∂–µ—Ç —É –Ω–µ—ë –µ—Å—Ç—å –∫–æ–Ω–µ—á–Ω–∞—è —Ü–µ–ª—å –∏ —è –∑–Ω–∞—é –∫–∞–∫–∞—è –±—ã—Ç—å —Å–∞–º–æ–π –≤–µ—Ä–Ω–æ–π –º–æ–µ–≥–æ —Ö—É—é //üå¥üçÅ',
'—Ä–∞—Å–∫–æ—Ä–º–∏–ª —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º —á—Ç–æ –æ–Ω–∞ —Ç–µ–ø–µ—Ä—å —è–≤–ª—è—Ç—å—Å—è –º–µ—Å—Ç–Ω—ã–º –±–æ—Å—Å–æ–º –∏ –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω—ã–º –∫—Ç–æ –µ—ë –º–æ–∂–µ—Ç –∫—Ä—ã—à–æ–≤–∞—Ç—å –µ—ë –Ω–∞ –¥–∞–Ω–Ω—ã–π –º–æ–º–µ–Ω—Ç —ç—Ç–æ –º–π —Ö—É–π –≤–µ–¥—å –æ–Ω–∞ –≤—Å–µ–≥–¥–∞ —Å—Ç–∞–≤–∏–ª –∑–∞ –Ω–µ–≥–æ —Å–≤–µ—á–∫–∏ //üå¥üçÅ',
'–Ω–µ –∫–æ–º—É –Ω–µ —Å–∫–∞–∂—É —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —É–∂–µ –Ω–∞—è—Ä–∏–≤–∞–µ—Ç –º–æ–π —Ö—É–π –ø–æ 100 —Ä–∞–∑—É –≤–µ–¥—å –æ–Ω–∞ —ç—Ç–æ –¥–µ–ª–∞–µ—Ç —Å —á–∏—Å—Ç–æ–π —Å–æ–≤–µ—Å—Ç—å—é –∏ –¥—É–º–∞–µ—Ç —á—Ç–æ –µ—Å–ª–∏ —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π —Ç–∞–∫ —á–∞—Å—Ç–æ –æ–Ω–∞ –ø–æ–ø–∞–¥—ë—Ç –≤ —Ä–∞–π //üå¥üçÅ',
'—Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫–∞—è –±–µ—Å–ø–æ–Ω—Ç–æ–≤–∞—è —á—Ç–æ –ø—Ä–µ–∂–¥–µ —á–µ–º –µ—ë –≤—ã–µ–±–∞—Ç—å —è –¥–∞—é –Ω–∞ —Ä–æ—Ç–∞–Ω —Ç–≤–æ–µ–º—É –æ—Ç—Ü—É –≤–µ–¥—å —Ç–∞–∫ –º–æ–π —Ö—É–π —É–∂–µ –≥–æ—Ç–æ–≤ –∫ —Å—Ç—Ä—ë–º–Ω–æ–π –≥–ª–æ—Ç–∫–µ —Ç–≤–æ–µ–π –µ–±—É—á–µ–π –º–∞—Ç—É—Ö–µ //üå¥üçÅ',
'—Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø–æ–º–∏–Ω–∫–∏ —Å–≤–æ–∏–º —Ö—É—ë–º –æ—Ä–≥–∞–Ω–∏–∑–æ–≤–∞–ª –∏ –≤—Å–µ —Ä–æ–¥—Å—Ç–≤–µ–Ω–∏–∫–∏ –±—ã–ª–∏ —Ä–∞–¥—ã –≤–µ–¥—å –º–æ–π —Ö—É–π —ç—Ç–æ —Å–∞–º—ã–π –ø–æ—á—ë—Ç–Ω—ã–π –≥–æ—Å—Ç—å –Ω–∞ –∏—Ö –ø–æ–º–∏–Ω–∫–∞—Ö –µ–∑ –µ–∑ //üå¥üçÅ',
'–ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å —Ä–µ—à–∏–ª–∞ –∑–∞—Ä–µ–π–¥–∏—Ç—å –º–æ–π —Ö—É–π —è –æ—Ç–±–∏–ª –µ—ë —Ä–µ–π–¥ –Ω–æ —Ä–µ—à–∏–ª –Ω–∞–∫–∞–∑—Ç—å –∑–∞ —Å—Ç–æ–ª—å –Ω–∏–∑–∫–æ–µ –¥–∏—è–Ω–∏—è —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –ª–∏–∂–µ—Ç –º–æ–µ–º—É –∫–µ–Ω—Ç—É –ø—è—Ç–∫–∏ –æ—Ä—É //üå¥üçÅ',
'–Ω–∞ –ø–∞–ª—É–±–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –Ω–µ –æ–¥–∏–Ω –º–æ—Ä—è–∫ –∞ –≤—Å—ë –ø–æ—Ç–æ–º—É —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –º–æ–∂–µ—Ç –∂–∏—Ç—å –±–µ–∑ —á—É–∂–∏–≤ —Ö—É—ë–≤ –∏ –¥–∞–∂ –±—É–¥—É—á–∏ –≤ –∑–∞–ø–µ—Ä—Ç–∏ –æ–Ω–∞ –Ω–∞–π–¥—ë—Ç –∫–∞–∫–æ–π –Ω–∏–±—É–¥—å —Ö—É–π //üå¥üçÅ',
'–Ω–µ –º–æ–≥—É –ø–æ–≤–µ—Ä–∏—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —Ç–∞–∫ –ø—Ä–æ—Å—Ç–æ –ø–æ–¥—Ç–∞–ª–∞—Å—å –Ω–∞ –ø—Ä–æ–≤–æ–∫–∞—Ü–∏—é –∫–∏–Ω—É—Ç—É—é –º–æ–∏–º —Ö—É—ë–º —á—Ç–æ —Ç–µ–ø–µ—Ä—å –¥–µ–ª–∞—Ç—å –¥–∞–≤–∞–π –ø–æ –Ω–∞–∫–∞—Ç–∞–Ω–æ–π –ø—Ä–æ—Å—Ç–æ —Ä–∞–∑–æ—Ä–≤—ë–º –µ–π –ø–µ—Ä–¥–∞–∫ //üå¥üçÅ',
'—Ç–≤–æ—è –º–∞–º–∞—à–∞ –¥–∞–∂–µ —Ä–∞—É–Ω–¥–∞ –ø—Ä–æ—Ç–∏–≤ –º–æ–µ–≥–æ —Ö—É—è –Ω–µ –≤—ã—Å—Ç–æ—è–ª–∞ —á—Ç–æ —Ç–µ–ø–µ—Ä—å –≥–≤–æ–æ—Ä–∏—Ç—å –æ –ø–æ–ª–Ω–æ—Ü–µ–Ω–æ–º –±–æ–µ –ø—É—Å—Ç—å —Ç—Ä–µ–Ω–∏—Ä—É–µ—Ç—å—Å—è –∞ –ø–æ–∫–∞ –æ–Ω–∞ —ç—Ç–æ –¥–µ–ª–∞—Ç—å –¥–∞–≤–∞–π —Å–æ—Å–∏ —Ä–∞–∫–∞–ª //üå¥üçÅ',
'–Ω–∞ —Ç–∞—Ä–∑–∞–Ω–∫–µ —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª –∫–æ–≥–¥–∞ –æ–Ω–∞ –ø—ã—Ç–∞–ª–∞—Å—å —Å–ø—Ä—ã–≥–Ω—É—Ç—å —Å –Ω–µ—ë —è –ø–æ–¥—Ö–≤–∞—Ç–∏–ª –µ—ë —Ö—É—ë–º –∏ —É–µ–±–∞–ª –æ–± –∑–µ–º–ª—é –ø—É—Å—Ç—å —Ç–æ–ª—å–∫–æ –µ—â—ë —Ä–∞–∑ –ø–æ–ø—Ä–æ–±—É–µ—Ç –≤—ã–∫–∏–Ω—É—Ç—å —á—Ç–æ –Ω–∏–±—É–¥—å —Ç–∞–∫–æ–µ //üå¥üçÅ',
'–Ω–µ –º–æ–≥—É –Ω–µ —á–µ–≥–æ —Å–∫–∞–∑–∞—Ç—å –ø–ª–æ—Ö–æ–≥–æ –Ω–∞—Å—á—ë—Ç —Ç–≤–æ–µ–π –º–∞–º—É–ª—å–∫–µ –Ω–æ –ø—Ä–∏–¥—ë—Ç—å—Å—è —Ä–∞—Å–∫—Ä—ã—Ç—å —Ç–µ–±–µ —Ç–∞–π–Ω—É –æ—Ç—Å–æ—Å —Ç—ã –º–µ—Ä–∑–∫–∏–π —á—Ç–æ –æ–Ω–∞ —Ä–∞–¥–∏ –º–æ–µ–≥–æ —Ö—É—è —Ç–≤–æ–π –∫–æ–º–ø –∑–∞–ª–æ–∂–∏–ª–∞ –æ—Ä—É //üå¥üçÅ',
'–Ω–∞ —Å–∫–∞—á–∫–∞—Ö –≤—Å–µ –±—ã–ª–∏ –Ω–∞ –∫–æ–Ω—è—Ö –∞ —Ç–≤–æ—è –º–∞—Ç—å –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω–∞—è —É—á–∞—Å—Ç–Ω–∏—Ü–∞ –∫–æ—Ç–æ—Ä–∞—è —Ä–µ—à–∏–ª–∞ –ø—Ä–æ—Å–∫–∞—Ç–∞—Ç—å –Ω–∞ –º–æ—ë–º —Ö—É–µ –Ω–µ —á—ë —Ç–∞–∫ –ø–æ–ª—É—á–∏–ª–æ—Å—å –∫—Å—Ç–∞—Ç–∏ –º–æ–π —Ö—É–π –≤–∑—è–ª —Ç–∞–º –ø–µ—Ä–≤–æ–µ –º–µ—Å—Ç–æ //üå¥üçÅ',
'—Ç–≤–æ—é –º–∞—Ç—å –∫–∞–∂–¥—ã–π –¥–µ–Ω—å —Ö—É—ë–º –≤ –º–∞–≥–∞–∑ –≥–æ–Ω—è—é –≤–µ–¥—å —è —Ç–∞–∫ –∑–∞–µ–±–∞–ª—Å—è –µ–π –Ω–∞ —Ä–æ—Ç–∞–Ω –¥–æ–≤–∞—Ç—å —á—Ç–æ —Ç–µ–ø–µ—Ä—å –º–æ—ë —Ä–∞–∑–≤–ª–µ—á–µ–Ω–∏—è —ç—Ç–æ –¥–µ–ª–∞—Ç—å –∏–∑ –Ω–µ—ë —Å–∞–º—É—é –ø–æ—Å–ª—É—à–Ω—É—é —à–ª—é—Ö—É //üå¥üçÅ',
'–º–æ–∂–µ—à—å –Ω–µ –≤–µ—Ä–∏—Ç—å –Ω–æ —Ç–≤–æ—é –º–∞—Ç—å –ø–µ—Ä–µ–±–∞–ª–∞ –ø–æ–ª –≥–æ—Ä–æ–¥–∞ –Ω–æ —è –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω—ã–π –∑–∞ —á–µ–π —Ö—É–π –æ–Ω–∞ –±—É–¥–µ—Ç —Å—Ç–æ—è—Ç—å –¥–æ –∫–æ–Ω—Ü–∞ –∏ –Ω–µ –∫–æ–≥–¥–∞ –Ω–µ —Å–¥–∞—Å—Ç –∑–∞–¥–Ω–∏—é —Ä–∏–ª–∏ //üå¥üçÅ',
'—Ç–≤–æ—è –º–∞—Ç—å –º–æ–π —Ö—É–π –º–µ—Å—Ç–æ –º–∞—Å–æ–∂–æ—Ä–∞ —Ä–µ—à–∏–ª–∞ –∏—Å–ø–æ–ª—å–∑—ã–≤–∞—Ç—å –Ω–æ —è –Ω–µ –∑–Ω–∞—é –µ—Å—Ç—å –ª–∏ –º–∞—Å–∞–∂–æ—Ä –ø–∏–∑–¥—ã –≤–µ–¥—å –µ–¥–∏–Ω—Å—Ç–≤–µ–Ω–Ω–æ–µ —á—Ç–æ –æ–Ω–∞ –¥–µ–ª–∞–µ—Ç —ç—Ç–æ —Å—É—ë—Ç –µ–≥–æ –≤ —Å–≤–æ—ë –≥–Ω–µ–∑–¥–æ //üå¥üçÅ',
'–¥–∞–∂–µ –Ω–∞ —Ä–∞–±–æ—Ç–µ —Ç–≤–æ—è –º–∞—Ç—å –∫–æ–≥–¥–∞ –≤—Å–µ –¥–µ–ª–∞—é—Ç –ø–ª–∞–Ω–æ–≤—ã–π –æ—á—ë—Ç –∏–ª–∏ –≤—ã—Ö–æ–¥—è—Ç –ø–æ–∫—É—Ä–∏—Ç—å –æ–Ω–∞ –º–Ω–µ –ø–æ —Å–∫–∞–π–ø—É —Å–æ—Å—ë—Ç –µ—Å–ª–∏ –±—ã–ª–æ –±—ã –≤–æ–∑–º–æ–∂–Ω–æ –Ω–µ –ø–ª–∞—Ç–∏—Ç—å –∑–∞ –º–æ–π —Ö—É–π –æ–Ω–∞ –±—ã –Ω–µ —Ä–∞–±–æ—Ç–∞–ª–∞ //üå¥üçÅ',
'—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Å—Ç–µ—Ä–µ–æ—Ç–∏–ø–Ω–æ–µ –º—ã—à–ª–µ–Ω–∏—è –æ–Ω–∞ –¥—É–º–∞–µ—Ç —á—Ç–æ –µ—Å–ª–∏ —è –µ–π –Ω–µ –Ω–∞–≤–µ—Ä–Ω—É–ª –ø–æ –≥–æ—Ä–±—É –∑–∞ –ø–ª–æ—Ö–æ–π –º–∏–Ω—å–µ—Ç —Ç–æ –±–æ–ª—å—à–µ —Ç–∞–∫ –¥–µ–ª–∞—Ç—å –∏ –Ω–µ –±—É–¥—É –∫–∞–∫ –Ω–∞ –æ—à–∏–±–∞–µ—Ç—å—Å—è //üå¥üçÅ',
'—Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ª–∏–Ω–∏—é –∂–∏–∑–Ω–∏ —Ö—É—ë–º –æ–±–æ—Ä–≤–∞–ª —Ç–µ–ø–µ—Ä—å –µ–π –ø—Ä–∏–¥—ë—Ç—å—Å—è –æ—Ç–ø—Ä–∞–≤–ª—è—Ç—å—Å—è –≤ –º–∏—Ä –∏–Ω–æ–π –Ω–∞ –∑–Ω–∞—è –∫–∞–∫–∞—è —Ç–≤–æ—è –º–∞–º–∞—à–∞ —à–ª—é—Ö–∞ –æ–Ω–∞ –¥–∞–∂–µ —Ç–∞–º –ø–æ–ø—Ä–æ—Å–∏—Ç –º–æ–π —Ö—É–π //üå¥üçÅ',
'–º–æ–π —Ö—É–π —Ç–≤–æ—é –º–∞—Ç—å –∂–µ –Ω–∞ –≤–µ—Ä—Ö–∫—É—à–∫—É –∑–∞–∫–∏–Ω—É–ª —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –æ–±—â–∞–µ—Ç—å—Å—è —Å –∏–Ω—Ç–µ–ª–µ–≥–µ–Ω—Ç–Ω—ã–º–∏ –ª—é–¥—å–º–∏ –Ω–æ –º—ã —Ç–æ –≤—Å–µ –∑–Ω–∞–µ–º –∫–∞–∫ –º—ã —Å –ø–∞—Ü–∞–Ω–∞–º–∏ –µ—ë —Ä–æ—Ç–∞–Ω –ø–æ –∫—Ä—É–≥—É –ø—É—Å–∫–∞–ª–∏ //üå¥üçÅ',
'–Ω–µ –æ—Ç—Ä–∏—Ü–∞–π —Ç–æ–≥–æ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å —Å–¥–∞–ª–∞—Å—å –º–æ–µ–º—É —Ö—É—é –æ–Ω–∞ –ø—ã—Ç–∞–ª–∞—Å—å —Å–æ–ø—Ä–æ—Ç–∏–≤–ª—è—Ç—å—Å—è –Ω–æ –º–æ–π —Ö—É–π –æ–∫–∞–∑–∞–ª—Å—è —Å–∏–ª—å–Ω–µ–µ –¥–∞–∂–µ —Ç–≤–æ–π –æ–ø—É—â–µ–Ω—ã–π –æ—Ç–µ—Ü —Å –Ω–∏–º –Ω–µ —Å–º–æ–≥ —Å–ø—Ä–∞–≤–∏—Ç—å—Å—è //üå¥üçÅ',
'–º–æ–∂–µ—Ç —Ç—ã –º–Ω–µ —Å–∫–∞–∂–µ—à—å –ø–æ—á–µ–º—É —Ç–≤–æ—è –º–∞—Ç—å –µ–±—É—á–∞—è –º–æ–ª–µ–∫—É–ª–∞ –æ–ø—è—Ç—å —Ä–µ—à–∏–ª–∞ –≤—ã–≤–µ—Å–∏—Ç—å –Ω–∞ —Å—Ç–µ–Ω–¥ –º–æ–π —Ö—É–π –æ–Ω–∞ —É–∂–µ –ø—Ä–æ–¥–∞–ª–∞—Å—å –µ–º—É –ø–æ–ª–Ω–æ—Å—Ç—å—é —Ä–∏–ª–∏ //üå¥üçÅ',
'–Ω–µ –∑–∞–±—ã–≤–∞–π –∫—Ç–æ —Ç–≤–æ—é –º–∞—Ç—å —Ö—É—ë–º —É–µ–±–∞–ª –∏ –≤—Å—ë —ç—Ç–æ –±—ã–ª–æ –≤–æ –±–ª–∞–≥–æ –≤–µ–¥—å —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ —Å—Ç–∞–ª–∞ —É–º–Ω–µ–µ –∏ –º–µ—Å—Ç–æ –æ—Ç—Å–æ—Å–∞ —Ç–≤–æ–µ–º—É –±–∞—Ç–∏ —Ç–µ–ø–µ—Ä—å –æ–Ω–∞ –¥–µ–ª–∞–µ—Ç –µ–≥–æ –º–Ω–µ //üå¥üçÅ',
'–º–æ–∂–µ—Ç —Ç—ã —â–∞—Å —É–ø–∞–¥—ë—à—å –Ω–∞ –∫–æ–ª–µ–Ω–∏ –∏ –Ω–∞—á–Ω—ë—à—å –º–Ω–µ —Å–æ—Å–∞—Ç—å –∞ —Ç–æ —è –ø–æ–∑–æ–≤—É —Ç–≤–æ—é –º–∞—Ç—å –∏ –æ–Ω–∞ —É–∂–µ –Ω–µ —Å–º–æ–∂–µ—Ç –æ—Ç–æ—Ä–≤–∞—Ç—å—Å—è –æ—Ç –º–æ–µ–≥–æ —Ö—É—è //üå¥üçÅ',
'—è –∂–µ —Ö—É—ë–º —Ç–≤–æ–π –ø–∏–∑–¥–∞–∫ –ø–æ–¥–≤–µ—Å–∏–ª –Ω–∞ –ª—é—Å—Ç—Ä—É —Ç–µ–ø–µ—Ä—å —Ç–≤–æ–π –±–∞—Ç—è –∫–æ–≥–¥–∞ –ø—Ä–æ—Ö–æ–¥–∏—Ç —Ä–∞–¥—É–µ—Ç—å—Å—è —á—Ç–æ —Ç–µ–±—è –≤—ã–µ–±–∞–ª –Ω–µ –∫–∞–∫–æ–π —Ç–æ –¥–æ–≤—Ä–æ–≤—ã–π –ø–∞—Ü–∞–Ω –∞ —è //üå¥üçÅ',
'–º–æ–∂–µ—Ç —Ç—ã –º–æ–π —Ö—É–π —Å–±–∞–ª–∞–Ω—Å–∏—Ä–æ–≤–∞–Ω–Ω–æ –Ω–∞—á–Ω—ë—à—å —Å–æ—Å–∞—Ç—å –∞ —Ç–æ —á—ë —Ç—ã –∫–∞–∫ –ª–∞—Ö –∑–∞ –æ–¥–Ω—É —â—ë–∫—É –ø—É—Å–∫–∞–µ—à—å –¥–∞–≤–∞–π –ø—Ä–µ—Å—Ç—É–ø–∞–π –∏–ª–∏ –æ–ø—è—Ç—å —Ç–≤–æ–π –±–∞—Ç—è –ø—Ä–∏–¥—ë—Ç –∏ –æ—Ç—Å–æ—Å—ë—Ç –º–Ω–µ //üå¥üçÅ',
'—Ç–≤–æ–π –±–∞—Ç—è –Ω—É–ª—ë–≤–∫–∞ –Ω–µ —á–µ–≥–æ –Ω–µ –º–æ–∂–µ—Ç –±–µ–∑ –º–æ–µ–≥–æ —Ö—É—è –≤–µ–¥—å –æ–Ω –≥–æ–≤–æ—Ä–∏—Ç —á—Ç–æ —ç—Ç–æ –µ–≥–æ —Å–≤–µ—Ç–ª—ã–π –ª—É—á–∏–∫ –≤ –±—É—â—É–µ–µ –≤–æ—Ç —ç—Ç–æ —è –µ–º—É —Ö—É—ë–º –º–æ–∑–≥–∏ –æ—Ç–±–∏–ª //üå¥üçÅ',
