'–µ—â—ë –æ–¥–Ω–æ —Å–ª–æ–≤–æ –ø—Ä–æ —Ç–≤–æ—é –º–∞—Ç—å —è —Ç–µ–±—è —Ö—É—ë–º —Ä–∞—Å—Ç–µ—Ä–∑–∞—é –¥—É—Ä–∞ —Ç—ã –µ–±–∞–Ω–∞—è –≤–µ–¥—å —Ç–≤–æ—è –º–∞—Ç—å –∏–¥–µ–∞–ª—å–Ω–∞—è —à–∞–ª–æ–≤–∞ –Ω–µ –æ–±–∏–∂–∞–π –µ—ë //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–ª —á—Ç–æ —è —Ç—è —Ö—É—ë–º –∫—Ä–µ—Å—Ç–∏–ª –∞ —Ç–≤–æ—è –º–∞—Ç—å —É–º—É–¥—Ä–∏–ª–∞—Å—å –¥–∞–∂–µ –≤ —Ç–∞–∫–æ–π –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω—ã–π –º–æ–º–µ–Ω—Ç –æ—Ç—Å–æ—Å–∞—Ç—å —Å–≤—è—â–µ–Ω–∏–∫—É //üå¥üçÅ',
'—è —Ç–µ–±—è –¥–∞–∂–µ –≤ –¥–µ—Ç—Å–∫–æ–º —Å–∞–¥—É –µ–±–∞–ª –∫–æ–≥–¥–∞ —Ç—ã –¥—Ä–∞–ª—Å—è –∑–∞ –º–∞—à–∏–Ω–∫–µ –∏ –ø–ª–∞–∫–∞–ª —á—Ç–æ —Ç–µ–±—è –Ω–µ –¥–∞–ª–∏ –º–∞—à–∏–Ω–∫—É –∫—Ç–æ —Ç–µ —Ö—É–π –æ—Ç –æ–±–∏–¥—ã —Å—É–≤–∞–ª //üå¥üçÅ',
'—Ç—ã —Å—Ç–∞–ª –ø–æ—Ö–æ–∂–∏–º –Ω–∞ —Å–≤–æ—é –º–∞—Ç—å —Ç–µ–±–µ —É–∂–µ —Ç–æ–∂–µ –Ω–µ –Ω—É–∂–Ω–∞ –ø—Ä–∏—á–∏–Ω–∞ —á—Ç–æ–±—ã –æ—Ç—Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π –Ω—É –µ—Å–ª–∏ —Ç–∞–∫ —Ç–æ —Ç—ã —Ç–æ–∂–µ –¥–æ—Å—Ç–æ–µ–Ω –∑–≤–∞–Ω–∏—è –ø–¥–∑–æ–±–æ—Ä–Ω–æ–π —à–ª—é—Ö–∏ //üå¥üçÅ',
'–Ω–µ –º–æ–≥—É –ø–æ–≤–µ—Ä–∏—Ç—å —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –æ–ø—è—Ç—å –≤–∑—è–ª–∞—Å—å –∑–∞ —Å—Ç–∞—Ä–æ–µ –∏ –ø—ã—Ç–∞–µ—Ç—å—Å—è –≤—ã—Å–ª–µ–¥–∏—Ç—å –º–æ–π —Ö—É–π –Ω—É –µ—Å–ª–∏ –æ–Ω–∞ –ø–æ–ø–∞–¥—ë—Ç—å—Å—è –º–Ω–µ –Ω–∞ –≥–ª–∞–∑–∞ —è –µ—ë —Ö—É—ë–º –≤ –ê—Ä–∞—Ö–Ω–≥–µ–ª—å—Å–∫ —à–≤—ã—Ä–Ω—É //üå¥üçÅ',
'–Ω–µ –¥—É–º–∞–π –Ω–µ —á–µ–≥–æ –ø–ª–æ—Ö–æ–≥–æ –Ω–æ —Ç–≤–æ—è –º–∞—Ç—å –∫–æ—Å–º–æ–Ω–∞–≤—Ç —è —Ç–µ–±–µ –Ω–µ –≤—Ä—É –Ω–µ –≤ –∫–æ–µ–º —Å–ª—É—á–∞–µ –∞ –∑–Ω–∞–µ—à—å –Ω–∞ —á—ë–º –ø—Ä–æ—Ö–æ–¥–∏–ª –µ—ë –ø–µ—Ä–≤—ã–π –ø–æ–ª—ë—Ç –Ω–∞ –º–æ—ë–º —Ö—É–µ –æ—Ä—É //üå¥üçÅ',
