'–¥–∞–≤–∞–π —è —Ç–≤–æ—é –∑–∞–¥–Ω–∏—Ü—É —à–∞–∫–∞–ª–∞ –µ–±–∞–Ω–Ω—ã–π —â–∞—Å —Ç—É—Ç —Ä–∞–∑–¥–∏—Ä–∞—Ç—å –±—É–¥—É —Ç—ã –≤–Ω–∞—Ç—É—Ä–µ —Ä–µ—à–∏–ª –º–µ–Ω—è –æ—Å–∏–ª–∏—Ç—å //üå¥üçÅ',
'—Ç–≤–æ–π –≥–æ–ª–∏–º—ã–π –¥–¥ —Ç—É—Ç –∏ –º–µ—Å—è—Ü–∞ –Ω–µ –ø—Ä–æ—Å—Ç–æ–∏—Ç —Ç—ã –≤–æ–æ–±—â–µ —à–∞—Ä–∏—à—å —Å –∫–µ–º —Å–≤—è–∑–∞–ª—Å—è –º–∞–ª—ã—à—å //üå¥üçÅ',
