'–¥–∞ —è —ç–∫—Å—Ç–∞–∑ –µ–±–∞–ª —à–∞—Ä–∏—à—å —á—Ç–æ —Ç—ã —Ç—É—Ç –º–Ω–µ –º–æ–∂–µ—à—å —Å–∫–∞–∑–∞—Ç—å –≤–µ–¥—å —è –∏ —Ç–≤–æ—ë —Ä—ã–ª–æ –Ω–∞ 3 —Å—Ç–æ—Ä–æ–Ω—ã –≤—ã–≤–µ—Ä–Ω—É //üå¥üçÅ',
'–Ω—É –∂–µ –æ–ø—Ä–∞–≤–¥–∞–π —Å–µ–±–µ —Ç–µ–º —á—Ç–æ —Ç–≤–æ–π –¥–¥ –æ—Ö—É–µ–Ω–Ω—ã–π –Ω–æ –ø—Ä–æ—Å—Ç–æ –±–æ—Ç –≥–æ–≤–Ω–æ –¥–∞ —è —Ç–≤–æ—é –º–∞—Ç—å –µ–±–∞–ª //üå¥üçÅ',
