'—è —Ç–µ–±—è –æ–±–∏–¥–µ–ª —Ç–µ–º —á—Ç–æ —è –≤—ã–µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å —Ç–æ–≥–¥–∞ –ø–æ–ª—É—á–∞–µ—Ç—å—Å—è —Ç–µ–±—è –æ–±–∏–¥–µ–ª –≤–µ—Å—å —Ä–∞–π–æ–Ω —á—Ç–æ –ª–∏ —Ü–∞–ø–ª—è –µ–±—É—á–∞—è //üå¥üçÅ',
'–Ω—É –∂–µ –¥–∞–≤–∞–π —Å–∫–∞–∂–∏ –º–Ω–µ —á—Ç–æ –Ω–∏–±—É–¥—å –ø–æ–∫–∞ —è —Ö–∞—Ä–∫–∞—é –≤ –µ–±–∞–ª–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∏–ª–∏ –æ–ø—è—Ç—å –Ω–∞—á–Ω—ë—à—å –≥–æ–≤–æ—Ä–∏—Ç—å –ø—Ä–æ —Ç–æ–ø–æ–ø–≤—ã–µ –¥–µ–¥–∏–∫–∏ //üå¥üçÅ',
