'–≤ –≥—Ä–∞–∂–¥–∞–Ω—Å–∫—É—é –æ–π–Ω—É –º—ã –µ–±–∞–ª–∏ –º–∞–º—É —Ç–≤–æ—é –∏ —Ç–∞–∫ –∏ —Å—è–∫ –Ω—É –≤–æ–æ–±—â–µ–º –Ω–µ –≤ —ç—Ç–æ–º –¥–µ–ª–æ –º—ã –µ—ë –µ–±–∞–ª–∏ –≤—Å–µ–≥–¥–∞ –∞ —Ç—ã —Ç–æ —á–º–æ —á—Ç–æ —Å–º–æ–∂–µ—à—å –ø—Ä–æ—Ç–∏–≤–æ–ø–æ—Å—Ç–∞–≤–∏—Ç—å //üå¥üçÅ',
'–∑–∞ –∫–∞–∂–¥–æ–µ –º–∞–ª–µ–π—à–µ–µ —Å–ª–æ–≤–æ –≤ —Å—Ç–æ—Ä–æ–Ω—É –º–µ–Ω—è —è –±—É–¥—É –ø–∏–∑–¥–∏—Ç—å —Ç–≤–æ—é –º–∞—Ç—å —á–ª–µ–Ω–æ–º –ø–æ–∫–∞ –æ–Ω–∞ –Ω–µ –ø–æ–º—É–Ω–µ–µ—Ç –Ω–æ —Å–∫–æ—Ä–µ–µ —É –º–µ–Ω—è —á–ª–µ–Ω –æ—Ç–≤–∞–ª–∏—Ç—å—Å—è //üå¥üçÅ',
'—è –∫–∞–∫ –≤–∏–Ω –¥–∏–∑–µ–ª—å —Ç–æ–ª—å–∫–æ –æ–Ω –≥–æ–Ω—è–ª –Ω–∞ –∫—Ä—É—Ç—ã—Ö —Ç–∞—á–∫–∞—Ö –∞ —è –≥–æ–Ω—è—é —Ç–≤–æ—é –º–∞–º—à—É —Ç–∞–ø–∫–æ–º –ø–æ —Ö–∞—Ç–µ –±–ª—è—Ç—å –Ω—É –∑–∞—Ç–æ —ç—Ç–æ –≤–µ—Å–ª–µ–µ //üå¥üçÅ',
'—Å–∞–º–æ–µ –æ–±–∏–¥–Ω–æ–µ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –Ω–µ –∑–∞—Å–ª—É–∂–∏–≤–∞–µ—Ç —Ç–∞–∫–æ–≥–æ –æ—Ç–Ω–æ—à–µ–Ω–∏—è –Ω–æ —á—Ç–æ –¥–µ–ª–∞—Ç—å –µ—Å–ª–∏ —ç—Ç–∞ —à–ª.—Ö–∞ –Ω–µ –ø–æ–Ω–∏–º–∞–µ—Ç —á—Ç–æ –Ω–µ—Ö—É—è –±—ã–ª–æ —Ä—ã–ø–∞—Ç—å—Å—è –Ω–∞ –º–µ–Ω—è //üå¥üçÅ',
'—è –∑–∞–ª–µ—Ç–∞—é –≤ —Ö–∞—Ç—É —Ç–∞–º –∫–æ–Ω–µ—á–Ω–æ –º–Ω–æ–≥–æ —à–ª—é—Ö –Ω–æ —Ç–≤–æ—è –º–∞—Ç—å —ç—Ç–æ –ø–∏–∑–¥–µ—Ü —á—ë –∑–∞ —Ç–æ–ø–æ–≤–∞—è —à–∞–ª–∞–≤–∞ —è —Ç–µ–±–µ –æ—Ç–≤–µ—á–∞—é –µ—ë –≥–æ–Ω–¥–æ —é–∑–∞—Ç—å //üå¥üçÅ',
'–Ω–µ –∫–∞–∫ –Ω–µ –ø–æ–π–º—É —Ç—ã –ø—Ä–∏–∫–∏–¥—ã–≤–∞–µ—à—å—Å—è –¥—É—Ä–∞—á–∫–æ–º –∏–ª–∏ —Ç–∞–∫ –∏ –µ—Å—Ç—å —Ç—ã –Ω–∞—Ö—É–π –ø—Ä–æ—Ç–∏–≤ –º–µ–Ω—è —Å–≤–æ—é —à–∞—Ä–º–∞–Ω—É –ø–æ—Å—Ç–∞–≤–∏–ª –∫—Ä–∞–± –µ–±—É—á–º–π //üå¥üçÅ',
'—Å–∫–æ–ª—å–∫–æ –±—ã –Ω–µ –ø—Ä–æ—à–ª–æ –ª–µ—Ç –º–æ–π –¥–¥ –±—É–¥–µ—Ç –ø–æ—Ç—Ä–æ—à–∏—Ç—å —ç—Ç—É –∫–æ–Ω—Ñ–µ—Ä–µ–Ω—Ü–∏—é –Ω—É –∞ —Ç—ã —à–µ—Ä—Å—Ç—å –µ–±–∞–Ω–Ω–∞—è –≤ —Å–∫–æ—Ä–æ–º –≤—Ä–µ–º–µ–Ω–∏ –æ—Ç–ª–µ—Ç–∏—à—å //üå¥üçÅ',
'–∑–∞ —Ç–µ–±—è –≤–æ–æ–±—â–µ–º –±–µ–∑ –≤—Ç–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–∞–≤–µ—Ä–Ω–æ –∫–æ–ø—ã—Ç–∞ –æ—Ç–∫–∏–Ω—É–ª –∫–∞–∫ –∏ –≤—Å–µ –º—ã –Ω—É –Ω–µ –µ–±–∞—Ç—å –µ—ë —Å–µ–∫—É–Ω–¥ 20 –Ω–∞–≤–µ—Ä–Ω–æ —ç—Ç–æ –¥–ª—è –Ω–∞—Å –Ω–∞–∫–∞–∑–∞–Ω–∏—è //üå¥üçÅ',
