'—è —Ç–≤–æ—é –º–∞—Ç—å –≤ –Ω–∞—Ç—É—Ä–µ –Ω–∞—Ö—É–π –≤—ã—Ä—É–±–ª—é –µ–±–∞—Ç—å —Å –æ–¥–Ω–æ–≥–æ –º–æ—â–Ω–æ–≥–æ —É–¥–∞—Ä–∞ —Å–≤–æ–µ–≥–æ —Ö—É—è –∏ —Ç—ã –±—É–¥–µ—à—å –≤—ã–∫–ø–∞—á–∏–≤–∞—Ç—å –º–æ—é —Å–ø–µ—Ä–º—É –∏–∑ –µ–µ –∂–æ–ø—ã —Å–≤–æ–∏–º–∏ —Ä—Ç–æ–º –µ–±–∞–Ω—ã–º–∏ —á—Ç–æ–±—ã –æ–Ω–∞ –≤—Å—Ç–∞–ª–∞ –∏ —Å–º–æ–≥–ª–∞ –ø—Ä–æ–¥–æ–ª–∂–∏—Ç—å —Å–≤–æ–π –∂–∏–∑–Ω–µ–Ω–Ω—ã–π –ø—É—Ç—å //üå¥üçÅ',
'–Ø —Ç–≤–æ—é –º–∞—Ç –±–ª—è—Ç—å –µ–±–≤–ª –Ω–∞ –∫–æ–≤—Ä–µ —Å–∞–º–æ–ª—ë—Ç–µ –∫–æ—Ç–æ—Ä—ã–π –≤—ë–∑ –Ω–∞—Å –≤ –Ω–µ–∏–∑–≤–µ—Å—Ç–Ω–æ–º –Ω–∞–ø—Ä–∞–≤–ª–µ–Ω–∏–∏ –∞ –∞–ª–ª–∞–¥–∏–Ω –¥—Ä–ª–æ—á–∏–ª –Ω–∞ —ç—Ç–æ –≤—Å–µ –∞ –ø–æ—Ç–æ–º –∫–æ–Ω—á–∏–ª –Ω–∞ –µ–±–ª–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —à–∞–¥–∞–≤—ã —ç—Ç–æ–π —Å–ø–∏–¥—Ä–∑–Ω–æ–π –µ–±–∞—Ç—å //üå¥üçÅ',
'–¢—ã –±–ª—è—Ç—å –ø–∏–¥–æ—Ä—é–≥–∞ –µ–±–∞–Ω—ã–π –∏–ª–∏ –ø—Ä–æ—á—å –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –ø–æ–∫–∞ —è —Ç–µ–±—è –æ–Ω –∑–∞–ø–∏–Ω–∞–ª –Ω–∞—Ö—É–π –∫–∞–∫ —Ñ—É—Ç–±–æ–ª—å–Ω—ã–π –º—è—á–∏–∫ –µ–±–∞–Ω—ã–π, —Å–≤–∏–Ω —Ç—ã –≥–ª—É–ø—ã–π —Å—É–∫–∞) –∑–∞–≤–∞–ª–∏ —Å–≤–æ—ë –µ–±–∞—Ç—å —Ö—É—è–º–∏ –∫–∞–∫ —á–µ—Ä–¥–∞—á–Ω–æ–µ–µ –ø–æ–º–µ—â–µ–Ω–∏–µ —Å—Ç–∞—Ä—ã–º–∏ –≤–µ—â–∞–º–∏ –≤—ã—Ö—É—Ö–æ–ª—å –µ–±–ª–∏–≤—ã–π —Å—É–∫–∞ //üå¥üçÅ',
'–¢—ã –±–ª—è—Ç—å –ø–æ–π–º–∏ –Ω–∞—Ö—É–π —á—Ç–æ –º–∞—Ç—å —Ç–≤–æ—è –Ω–µ —Å–º–æ–∂–µ—Ç –∏–∑–±–∞–≤–∏—Ç—å—Å—è –æ—Ç –º–æ–µ–≥–æ —Ö—É—è –Ω–∏–∫–æ–≥–¥–∞ –ø–æ–∫–∞ –Ω–µ –∑–¥–æ—Ö–Ω–µ—Ç –Ω–∞—Ö—É–π –ø–æ–¥ –∑–∞–±–æ—Ä–æ–º —à–ª—é—Ö—É –ø–∞—Ä–æ—à—Ç–≤–∞—è –∏ —Ç–µ–±–µ —Å–ª–µ–¥—É–µ—Ç –Ω–∞—á–∞—Ç—å —Å–ª–µ–¥–∏—Ç—å –∑–∞ –Ω–µ–π —á—Ç–æ–±—ã –æ–Ω–∞ –Ω–µ –Ω–∞—Ç–≤–∞—Ä—Ç–ª–∞ –¥–µ–ª–æ–≤ –∏ —Å–æ—Å–∞—Ç—å —Ç–æ–ª—å–∫–æ –º–Ω–µ //üå¥üçÅ',
'–¢—ã —Å—É–∫–∞ –¥—É—Ä–∞–ª–µ–π –µ–±–∞–Ω—ã–π –ø–æ—á–µ–º—É —Ç—ã –º–æ–π —Ö—É—Ü —Ç–∞–∫—Ç –ø–ª–æ—Ö–æ –Ω–∞—á–∞–ª —Å–æ—Å–∞—Ç—å? –ò–¥–∏ –¥–∞–≤–∞–π –≤–æ–∑—å–º–∏ –ø–∞—Ä–æ–≤ —É—Ä–æ–∫–æ–≤ —É —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –ø–∏–¥–æ—Ä–∞—Å–∫–∏ —á—Ç–æ–±—ã –Ω–∞—É—á–∏—Ç—å—Å—è —Ö–æ—Ç—å –Ω–µ–º–Ω–≥–æ–æ–æ –Ω–æ—Ä–º–∞–ª—å–Ω–æ —Å–æ—Å–∞—Ç—å –º–Ω–µ –Ω–µ –∑–∞–¥–µ–≤–∞—è –º–æ–π —Ö—É—Ü —Å–≤–æ–∏–º–∏ –∑—É–±–∞–º–∏ //üå¥üçÅ',
'–Ø —Ç–≤–æ—é –º–∞—Ç—å –µ–±—É –≥–æ–≤–Ω–æ–µ–¥ —Ç—ã –µ–±–∞–Ω—ã–π –∏ –æ–Ω–∞ —Å–µ–π—á–∞—Å –ª–µ–∂–∏—Ç –Ω–∞ –ø–æ–ª—É –≤—Å—è –≤ –º–æ–µ–π —Å–ø–µ—Ä–º–µ —à–∞–ª–∞–≤–∞ –µ–±–∞–Ω–∞—è –∞ –ø–æ—Ç–æ–º —è –¥—É–º–∞—Ç—å —á—Ç–æ –Ω—É–∂–Ω–æ –±—É–¥–µ—Ç –æ—Ç–ø–∏–∑–∂–∏—Ç—å —ç—Ç—É —à–ª—é—Ö—É –µ–±–∞–Ω—É—é –∏ –≤—ã–∫–∏–Ω—É—Ç—å –Ω–∞—Ö—É–π –≤ –ª–µ—Å—Ç–Ω–∏—Ü—ã –≤ –ø–∞–¥–∏–∫–µ //üå¥üçÅ',
'–¢—ã –ø–æ–Ω–∏–º–∞–µ—à—å —Å—É–∫–∞ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –µ–±–∞–Ω–∞—è —à–ª—é—Ö–∞ –∏ –æ–Ω–∞ –±—É–¥–µ—Ç —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É—Ü –∫–∞–∂–¥—ã–π —Ä–∞–∑ –∫–∞–∫ —Ç–æ–ª—å–∫–æ —è –µ–π —ç—Ç–æ —Ä–∞–∑—Ä–æ–µ—à—Ü —Å–æ–ø–ª—è–∫ —Ç—ã –µ–±–∞–Ω—ã–π? –ú–æ–π —Ö—É–π –≤–ª–∞–¥—ã–∫–∞ –ø–∏–∑–¥—ã —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∏ —Ç–∞–º –≤—Å–µ –Ω–∞—Ö–æ–¥–∏—Ç—Å—è –ø–æ–¥ –µ–≥–æ –æ—Ç–≤–µ—Ç—Å—Ç–≤–µ–Ω–Ω–æ—Å—Ç—å—é –∏ –≤—Å–µ —Ö–æ–∑—è–π—Å—Ç–≤–æ –ø—Ä–µ–Ω–∞–¥–ª–µ–∂–∏—Ç—å —Ç–æ–ª—å–∫–æ –µ–º—É //üå¥üçÅ',
'–¢—ã —Å—É–∫–∞ –≥–æ–±–ª–∏–Ω –µ–±–∞–Ω—ã–π –¥–∞–≤–∞–π —É–∂–µ –ø—Ä–∏–Ω–∏–º–∞–π—Å—è —Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É—Ü –∏–Ω–∞—á–µ —è –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Ä–∞—Å—Ç—è–Ω—É –ø–æ –≤—Å–µ–π —Å–≤–æ–µ–π –∑–∞–ª—É–ø–∞ –∏ —Ç—ã –±—É–¥–µ—à—å —Å–Ω–∏–º–∞—Ç—å –µ–µ –ø–æ–¥–∫–æ–≤—ã—Ä–∏–≤–∞—è –Ω–æ–∂–∏–∫–æ–º //üå¥üçÅ',
'–Ø —Ç–≤–æ—é –º–∞—Ç—å –Ω–æ—á—å—é —Ö—É–µ–º —á—É—Ç—å –Ω–µ –ø—Ä–∏–¥—É—à–∏–ª –∫–æ–≥–¥–∞ –æ–Ω–∞ –Ω–∞—á–∞–ª–∞ –µ–≥–æ —Å–æ—Å–∞—Ç—å —Ç–æ —Ü –º–µ–Ω—è —Ä–µ—ã–ª–µ–∫—Ç–æ—Ä–æ–Ω–æ –ø–æ–ª—É—á–∏–ª–æ—Å—å —Ç–∞–∫ —á—Ç–æ —è –æ–±–º–∞—Ç–∞–ª –µ–≥–æ –≤–æ–∫—Ä—É–≥ —à–µ–∏ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∏ —Å–∂–∞–ª –µ–µ –∫–∞–∫ —É–¥–∞–≤ –µ–±–∞—Ç—å //üå¥üçÅ',
'—Ç—ã –∂–µ –ø–æ–Ω–∏–º–∞–µ—à—å —É–µ–±–æ–∫ –µ–±–∞–Ω–Ω—ã–π —á—Ç–æ —Ç—ã –º–µ–Ω—è –Ω–µ –≤—ã–≤–æ–∑–∏—à—å, —Ç—ã —á–µ—Ç –ø—ã—Ç–∞–µ—à—å—Å—è –ø—Ä–æ–ø–∏–∑–¥–µ—Ç—Å—è –Ω–∞ –º–æ–π —Ö—É–π –∫–æ—Ç–æ—Ä—ã–π –¥–∞–≤–Ω–æ –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ //üå¥üçÅ',
'–∞ —ç—Ç–æ –ø—Ä–∞–≤–¥–∞ —á—Ç–æ —Ç–≤–æ–π –æ—Ç–µ—Ü –∏–∑–Ω–∞—Å–∏–ª–æ–≤–∞–ª —Ç–µ–±—è –∏ –µ–≥–æ –ø–æ—Å–∞–¥–∏–ª–∏?) —Å–≤–∏–Ω–æ–º–∞—Ç –Ω–∞ —Ö—É–π –≥—Ä—è–∑–Ω—ã–π —è —É–≤–µ—Ä–µ–Ω —Ç—ã –µ–±–µ—à—å —Å–≤–æ–µ–≥–æ –æ—Ç—Ü–∞ //üå¥üçÅ',
