'—Ç—ã –ø–æ—á–µ–º—É –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ —è –ø–æ–µ–±–∞–ª —Ç–≤–æ—é –º–∞—Ç—å –∏ –ø–æ—Ä–≤–∞–ª –µ–µ –≤–∞–≥–∏–Ω–∞–ª—å–Ω–æ–µ –æ—Ç–≤–µ—Ä—Å—Ç–∏–µ –Ω–µ —Å—Ç–∞–ª –∑–∞–ª–∏–≤–∞—Ç—å –µ–≥–æ –∞ –ø—Ä–æ—Å—Ç–æ –Ω–∞–±–ª—é–¥–∞–ª —Å–æ —Å—Ç–æ—Ä–æ–Ω—ã –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å –∫–æ—Ä—á–∏—Ç—Å—è –æ—Ç –±–æ–ª–∏ –≤ —Ä–∞–π–æ–Ω–µ –≥–µ–Ω–∏—Ç–∞–ª–∏–π? //üå¥üçÅ',
'–≤–Ω–∞—Ç—É—Ä–µ —Å–ª—ã—à–∏—à—å —É–µ–±–æ–∫ –¢—ã –º–Ω–µ —Å–≤–æ–µ –µ–±–∞–ª–æ –æ—Ç–∫—Ä–æ–π —è —Ö–æ—Ç—å —Ç–µ–±–µ –≤ —Ä–æ—Ç –Ω–∞—Å—Å—É —á—Ç–æ–ª–∏, —Ç–≤–æ—è –º–∞—Ç—å –≥—Ä—è–∑–Ω–∞—è —à–ª—é—Ö–∞ –∫–æ—Ç–æ—Ä–∞—è —Å–æ—Å–∞–ª–∞ –≤—Å–µ–º –º–æ–∏–º –¥—Ä—É–∑—å—è //üå¥üçÅ',
