'–µ–¥–∏–Ω—Å—Ç–≤–µ–Ω–Ω—ã–π —Å—ã–Ω –≤ —Å–≤–æ–µ–π —Å–µ–º—å–µ –∫–æ—Ç–æ—Ä—ã–π —Ç–∞–∫ –Ω–µ–∂–Ω–æ –∏ –±–ª–∞–≥–æ–ø—Ä–∏—è—Ç–Ω–æ –≤–æ—Å–ø—Ä–∏–Ω–∏–º–∞–µ—Ç –º–æ—é —Å–ø–µ—Ä–º—É –≤ —Å–≤–æ—ë –∞–Ω–∞–ª—å–Ω–æ–µ –æ—Ç–≤–µ—Ä—Å—Ç–∏–µ –∏ –≤ —á–µ—Å—Ç—å —Ç–∞–∫–æ–≥–æ —Ö–æ—Ä–æ—à–µ–≥–æ –æ—Ç–Ω–æ—à–µ–Ω–∏—è –º–Ω–µ –Ω—É–∂–Ω–æ –±—É–¥–µ—Ç –æ–¥–∞—Ä–∏—Ç—å –µ–≥–æ –¥–∞—Ä–∞–º–∏ –ø—Ä–∏—Ä–æ–¥—ã –∏–∑ –º–æ–µ–≥–æ —Ö—É—è //üå¥üçÅ',
'—Ç—ã –¥–∞–≤–∞–π –æ—Ñ–æ—Ä–º–ª—è–π –∏–ø–æ—Ç–µ–∫—É —Å –º–æ–∏–º–∏ —è–π—Ü–∞–º–∏ , –∫—É–ø–∏—à—å —Å–µ–±–µ —Ö–æ—Ç—å –Ω–æ–≤—ã–µ –∫—Ä–æ—Å—ã –∞ —Ç–æ —É–∂–µ –≤ –æ–¥–Ω–∏—Ö 4 –≥–æ–¥–∞ —Ö–æ–¥–∏—à—å –Ω–µ —Å—Ç—ã–¥–Ω–æ –ª–∏? –∏—Ö –ö–û–¢ –Ω–∞–≤–µ—Ä–Ω–æ —Ç–≤–æ–π –æ–±–æ—Å—Å–∞–ª —É–∂–µ –ø–∏–∑–¥–µ—Ü //üå¥üçÅ',
'–æ—á–µ–º—É —Ç—ã —Ç–∞–∫ –Ω–µ –ª—é–±–∏—à—å —Å–≤–æ—é –º–∞—Ç—å –∏ —à—É—Ç–∏—à—å –ø—Ä–æ –Ω–µ–µ?) –ø—Ä–æ—Å—Ç–æ —è –ø—Ä–∏–µ–º–Ω—ã–π —Å—ã–Ω —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –∫–æ—Ç–æ—Ä—É—é –µ–±—É //üå¥üçÅ',
