'—Ç—ã –±–ª—è—Ç—å –º–Ω–µ –≥–ª–∞–≤–Ω–æ–µ –ø–æ–∫–∞–∂–∏ –≥–¥–µ –∏ –≤ –∫–∞–∫–æ–µ –º–µ—Å—Ç–æ —Ç–µ–±—è –≤—ã–µ–±–∞—Ç—å/–∏ —è —Ç–µ–±—è –Ω–∞–≥—Ä–∞–∂—É —Å–ø–µ—Ä–º–æ–π –ø–æ–Ω—è–ª –ø–∏–∑–¥–∞—é–± –µ–±–∞–Ω—ã–π //üå¥üçÅ',
'–±–ª—è —Ç—ã —Ä–∏–ª–∏ –¥—É–º–∞–µ—à—å —á—Ç–æ —Ç—ã –º–µ–Ω—è —Å–∏–ª—å–Ω–µ–µ? —Ö—É–µ—Å–∞—Å –æ—á–Ω–∏—Å—å —è —Ç–µ–±—è –≤—ã–µ–±—É —Ç—ã –¥–∞–∂–µ –≤—è–∫–Ω—É—Ç—å –Ω–∞—Ö—É–π –Ω–µ —É—Å–ø–µ–µ—à—å –ø–æ–Ω–∏–º–∞–µ—à—å —Ç—ã –≤ –∞—Ö—É–µ –±—É–¥–µ—à—å –ø–æ–∫–∞ —Ç–µ–±—è –µ–±–∞—Ç—å –±—É–¥—É //üå¥üçÅ',
