'—Å–ª—ã—à —è —â–∞ –Ω–∞ —Å–≤–æ—é –∑–∞–ª—É–ø—É –≤–æ–∑–Ω–µ—Å—É —Ç–≤–æ—é –ø–∏–∑–¥–∞–∫ —Ç–≤–æ–µ–π –º–∞–º–æ—á–∫–∏ –∏ –Ω–∞—á–Ω—É –≤—Å—Ç—É–ø–∞—Ç—å —Å–≤–æ–∏–º —Ö—É–µ–º –≤ –ø–æ–ª–æ–≤–æ–π –∫–æ–Ω—Ç–∞–∫—Ç —Å —Ç–≤–æ–∏–º–∏ —É—à–∞–º–∏))) //üå¥üçÅ',
'–ø–æ–º–Ω–∏—à—å –∫–∞–∫ —è —Å–ø–∏–∑–¥–µ–ª –∫–æ–ø—å–µ —É —Ä—ã—Ü–∞—Ä—è –∏ —ç—Ç–∏–º –∂–µ –∫–æ–ø—å–µ–º –æ—Ç—ä–µ–±–∞–ª —Ç–≤–æ—é –±–∞–±—É—à–∫—É!) //üå¥üçÅ',
'—Ö—É–µ—Å–æ—Å?) —Ç—ã —É–≤–∏–¥–µ–ª –ø–∏–∑–¥—É —Å–≤–æ–µ–π –º–∞–º—ã –∏—Å–ø—É–≥–∞–ª—Å—è –∏ —Å—ä–µ–±–∞–ª—Å—è? //üå¥üçÅ',
