'–±–ª—è—Ç—å —Ç—ã —á–µ –Ω–∞–∑—É–π –Ω–∞—Ö—É–π –∞—Ö—É–µ–ª–∞ –ø–∏–∑–¥–∞–ª–∏–∑–∫–∞ –µ–±–∞–Ω–∞—è —Ç–µ–±—è —á—Ç–æ –Ω–∞—Ö—É–π –µ–±–∞—Ç—å –µ–∞–∫ —à–ª—é—Ö—É –¥—Ä–∞–Ω—É–± –∏–ª–∏ —á—Ç–æ –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π –¥–∞ —è/—Ç–µ–±—è –µ–±–∞—Ç—å –∫–∞–∫ —à–ª—é—Ö—É –±—É–¥—É –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –µ—å–∞–Ω—ã–π –Ω–∞–∑—É–π –ø–æ—à–µ–ª –ø–µ—Ç—É—Ö –¥—Ä–∞–Ω–Ω—ã–π —è –∂–µ –Ω–∞—Ö—É–π –µ–±–∞—Ç—å —Ç–µ–±—è –±—É–¥—É –ø–æ–º–Ω–∏—à—å –∫–∞–∫ —Ç–≤–æ—è –º–∞—Ç—å –Ω–∞—á–∞–ª–∞ —Å–æ—Å–∞—Ç—å –º–Ω–µ —Ö—É–π –∏ –ø–æ–±–µ–∂–∞–ª–∞ –≤ —Ç—É–∞–ª–µ—Ç –≤–æ –≤—Ä–µ–º—è –∫–æ–≥–¥–∞ —É —Ç–µ–±—è –ø–æ–Ω–æ—Å–∏–ª –∏ —Ç—ã –Ω–∞—Å—Ä–∞–ª –Ω–∞ —Å–≤–æ—é –º–∞—Ç—å –∞ –æ–Ω–∞ –∑–∞ —ç—Ç–æ —Ç–µ–±—è –µ—Ä—à–∏–∫–æ–º –≤—ã–µ–±–∞–ª–∞ –ø–æ–º–Ω–∏—à—å —Ç—ã –∂–µ –Ω–∞—Ö—É–π –Ω–µ–∫—á–µ–º–Ω—ã–π –ø–∏–¥–æ—Ä–∞—Å —Ç–µ–±—è –º–∞–ª–æ –≤—ã–µ–±–∞—Ç—å –∏ —Ç—ã –µ—â—ë –ø—ã—Ç–∞–µ—à—å—Å—è —á—Ç–æ —Ç–æ –ø–∏—Å–∞—Ç—å —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π )–ø–æ–º–Ω–∏—à—å –∫–∞–∫ —É—á–µ–Ω—ã–µ –Ω–∞—à–ª–∏ –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∫–º –∫–æ—Å—Ç—å –¥–∏–Ω–æ–∑–∞–≤—Ä–∞? —Ç—ã –Ω–∞—Ö—É–π –º–æ–µ–≥–æ—Ö—É—è –Ω–µ —Å—Ç–æ–∏—à—å –ø—Ä–∏—á–µ–º —Ç—É—Ç —Ç–≤–æ–π –æ—Ç—Å–æ—Å –µ–±–∞–Ω—ã–π —Ç—ã –∑—É–Ω—Å–∞–∞ —Ç—ã —É –º–µ–Ω—è –±–µ—Å–ø–ª–∞—Ç–Ω–æ —Å–ø–∞—Å–∞—Ç—å –¥–æ–ª–∂–µ–Ω –ø–æ–Ω–∏–º–∞–µ—à—å —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π –≤ —Ä–æ—Ç —Ç—ã –±–ª—è—Ç—å –ø–µ—Ç—É—Ö –µ–±–∞–Ω—ã–π –ø–æ—à–µ–ª —è —Ç–µ–±–µ –≥–æ–≤–æ—Ä–± –Ω–∞ —Ö—É–π –ø–∏–¥–æ—Ä–∞—Å //üå¥üçÅ',
'—Å–ª—ã—à—å —Ç—ã –ø–∏–¥–æ—Ä–∞—Å —Ç—ã –º–µ–Ω—è –Ω–µ –∑–∞—Ç—Ä–æ–ª–∏—à—å –∏–±–æ —Ç—ã —Ö—É–π –º–Ω–µ —è–∑—ã–∫–æ–º –º–æ–∑–æ–ª–∏—à—å, —è –µ–±–∞–ª —Ç–µ–±—è –≤ —Ä–æ—Ç —Ç–∞–∫ —á—Ç–æ –∏–¥–∏ –Ω–∞—Ö—É–π –µ–±–∞–Ω—ã–π –≤ —Ä–æ—Ç) –µ–±–∞–ª–∏ —Ç–µ–±—è —á—É—Ä–∫–∏ —Ç—ã –µ—â—ë —Ö–æ—á–µ—à—å –º–Ω–µ —á—Ç–æ —Ç–æ –ø–∏–∑–¥–µ—Ç—å? —Ö—É–µ—Å–∞—Å —Ç—ã –µ–±–∞–Ω—ã–π //üå¥üçÅ',
