'—è –Ω–∞—Ö—É–π –≤—ã–µ–±—É —Ç–µ–±—è –µ–±–∞—Ç—å –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π –Ω–∞—Ö—É–π —è —Ç–µ–±–µ –∑–∞—Å—Ç–∞–≤–ª—é —è–∑—ã–∫–æ–º —Ç–≤–æ–∏–º –ø–∏–∑–¥—É —Å–≤–æ–µ–π –º–∞–º–∫–∏ –ª–∏–∑–∞—Ç—å/–ø–æ–Ω–∏–º–∞–µ—à—å? —Ö—É–µ—Å–∞—Å —Ç—ã –∫—Ä–Ω—á–µ–Ω–Ω—ã–π –Ω–∞—Ö—É–π –ø–∏–∑–¥–∞–ª–∏–∑ –µ–±–∞–Ω—ã–π //üå¥üçÅ',
'—Å–ª—ã—à—å —Ö—É–µ—Å–∞—Å –µ–±–∞–Ω—ã–π –æ—Ö—É–µ–ª? –±–ª—è—Ç—å —è –Ω–∞—Ö—É–π –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞–º–∫–∏ —Ä–≤–∞—Ç—å –±—É–¥—É —Ç–∞–∫ —á—Ç–æ –Ω–∞—Ö—É–π —à–µ–ª –æ—Ç—Å—é–¥–∞ –ø–∏–¥–æ—Ä–∞—Å –µ–±–∞–Ω—ã–π —Ç—ã —á–µ –¥–∞–≤–Ω–æ –Ω–∞—Ö—É–π –ø–∏–∑–¥—ã –Ω–µ –ø–æ–ª—É—á–∞–ª? —Ö—É–µ—Å–∞—Å –µ–±–∞–Ω—ã–π //üå¥üçÅ',
