'—Ç–∞–∫, —Ç–æ –µ—Å—Ç—å —Ç—ã –Ω–µ —Ä–µ—à–∏–ª –∑–∞–¥–∞—á—É —Å—Ç–∞–≤–ª—é —Ç–µ–±–µ –∑–∞ —ç—Ç–æ 2 —Ö—É—è –Ω–∞ –æ—Ç—Å–æ—Å, —Ç–∞–∫ –Ω–æ–≤–∞—è –∑–∞–¥–∞—á–∞ –Ω–æ –ª–µ–≥–∫–∞—è –¥–∞–∂–µ —Ç–∞–∫–æ–π —Ö—É–µ—Å–∞—Å –∫–∞–∫ —Ç—ã —Å–º–æ–∂–µ—Ç —Ä–µ—à–∏—Ç—å —ç—Ç—É –∑–∞–¥–∞—á—É –≤–æ—Ç —Å–º–æ—Ç—Ä–∏, —Ç–≤–æ—è –º–∞—Ç—å —Å–ø—Ä—è—Ç–∞–ª–∞ —É —Å–µ–±—è –≤ –ø–∏–∑–¥–µ 17 –∑–æ–ª–æ—Ç—ã—Ö –º–æ–Ω–µ—Ç, –ø—Ä–∏—à–µ–ª –Ω–∏–≥–µ—Ä –æ—Ç—å–±–µ–ª –µ—ë –∏ –æ–Ω –Ω–∞—Å–∫—Ä–µ–± —Å –µ–µ –ø–∏–∑–¥—ã 7 –º–æ–Ω–µ—Ç, —Å–∫–æ–ª—å–∫–æ –º–æ–Ω–µ—Ç –≤ –ø–∏–∑–¥–µ —É —Ç–≤–æ–µ–π –º–∞–º–∫–∏?  //üå¥üçÅ',
'—Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —Ç–æ —á—Ç–æ —É –Ω–∞—Å —Å —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä—å—é –Ω–∞—á–∞–ª–∞—Å—å –ª—é–±–æ–≤—å, —è –µ—ë –µ–±—É, –∏ –æ–Ω–∞ –º–æ–π —Ö—É–π –æ—Ç—Å–∞—Å—ã–≤–∞–µ—Ç, —Ç—ã –±—É–¥–µ—à—å —Ç–∞–∫-–∂–µ –æ—Å—Ç–∞—Å—ã–≤–∞—Ç—å –∫–∞–∫ –∏ —Ç–≤–æ—è –º–∞–º–∞—à–∫–∞ –∑–∞–≥–Ω–æ–µ–±–ª–µ–Ω–Ω–∞—è —Ö—É—è–º–∏?)  //üå¥üçÅ',
