'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –ø—Ä–∏—Å—Ç–µ–±—ã–≤–∞–ª–∞ –º–æ–∏–º —Ö—É–µ–º —Å–≤–æ—é –ø–∏–∑–¥—É, –µ–±–∞–Ω–Ω–∞—è —Ç—ã –∫–ª—è—á–∞. —è —Å–≤–æ–∏–º —Ö—É–µ–º —Å–Ω–æ—Å–∏–ª –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏. –≥–æ–ª—É–±–æ–≥–ª–∞–∑–∞—è —Ç—ã —à–∞–ª–∞–≤–∞)  //üå¥üçÅ',
'—è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –≤—ã–∑–æ–≤—É –Ω–∞ –µ–±–±–ª—é –∫ —Å–≤–æ–µ–º—É —Ö—É—é, –µ–±–∞–Ω–∞–Ω—è —Ç—ã –ø–¥–∏–æ—Ä–∞—Å–∫–∞. —Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞—Ç—å –∑—Ä—è –Ω–∞–ø–∞–ª–∞ –Ω–∞ –º–æ–π —Ö—É–π —Å–≤–æ–µ–π —Ç—å–µ–±–∞–Ω–Ω–æ–π –ø–∏–∑–¥–æ–π –ª–æ—Ö —Ç—ã —Å—É–∫–∞)  //üå¥üçÅ',
'–µ–±–∞—Ç—å –¥–∞ —è –≤–Ω–∞—Ç—É—Ä–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –∫–æ–Ω—á–µ–Ω–Ω—É—é —Ö—É—è–º–∏ –∑–∞–∫–∏–¥–∞—é –∫–æ–≥–¥–∞ –æ–Ω–∞ –±—É–¥–µ—Ç —Å–≤–æ–µ–π –ø–∏–∑–¥–æ–π –Ω–∞ –º–æ–π —Ö—É–π –ø—Ä—ã–≥–∞—Ç—å, –µ–±–∞–Ω–Ω—ã–π —Ç—ã —Å—É–∫–∞ –æ—á–∫–æ–Ω–∞–≤—Ç)  //üå¥üçÅ',
'—è —á–∏—Å—Ç–æ –ø–æ–¥–Ω–∏–º–∞–ª –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ –Ω–∞ —Å–≤–æ–µ–º —Ö—É–µ. –µ–±–∞—Ç—å –æ–Ω–∞ –∞—Ö–µ—É–≤–∞–ª–∞ –µ–±–∞–Ω–Ω–∞—è –∫–ª—É—à–∞, —Å–ª—ã—à–∏—à—å —Ç—ã —Å–Ω–∞–π–ø–µ—Ä –º–æ–µ–≥–æ —Ö—É—è. —è –Ω–∞–µ–±—ã–≤–∞–ª –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞—Ç—É—Ö–∏ –µ–±–∞–Ω–Ω–æ–π)—ä  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ —á–∏—Å—Ç–æ —Å–ø—Ä–∞—à–∏–≤–∞–µ—Ç —É –º–æ–µ–≥–æ —Ö—É—è –ø–æ—á–µ–º—É –æ–Ω —Ç–∞–∫ –º–∞–ª–æ —É–¥–µ–ª—è–µ—Ç –µ–π –≤–Ω–∏–º–∞–Ω–∏—è, –∫–∞–∫ –¥—É–º–∞–µ—à—å –ø–µ—Ä–µ—Å—Ç–∞—Ç—å —Ç–µ–±—è –µ–±–∞—Ç—å —á—Ç–æ–ª–µ?)  //üå¥üçÅ',
'—è —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ —Ä–æ—Ç –≤—ã—Ç—Ä–∞—Ö–∞—é –∫–æ–Ω—á–µ–Ω–Ω—ã–π —Ç—ã –µ–≤–Ω—É—Ö —Å—É–∫–∞, –º–æ–π —Ö—É–π –ø–æ–∏–º–µ–µ—Ç –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ –ø–æ–ª–Ω–æ—Å—Ç—å—é –µ–±–∞–Ω–Ω–∞—è —Ç—ã —Å–æ—Å–∫–∞), —è –∂–µ –≤—Å–µ—Ä–æ–≤–Ω–æ —Ç–≤–æ—é –º–∞–º–∞—à–∫—É –µ–±–∞–Ω–Ω—É—é —à–∞–ª–∞–≤—É –æ—Ç—å–µ–±—É —Ö—É–µ–º —Å–ª—ã—à–∏—à—å –µ–±–∞–Ω–Ω—ã–π —Ç—ã –∫–ª–æ—É–Ω)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —è —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ –ø–∏–∑–¥–∞–∫ –≤—ã—Ç—Ä–∞—Ö–∞—é –µ–±–∞–Ω–Ω–∞—è —Ç—ã –º—Ä–∞–∑–æ—Ç–∞, –º–æ–π —Ö—É–π –≤ –ø–∞—Ä–∞—à–µ –µ–±–∞–ª —Ç–≤–æ—é –º–∞–º–∞—à—É –∫–æ–Ω—á–µ–Ω–Ω—É—é –≤–æ—Ç —Ç—ã —Å—É–∫–∞ –¥–∞—É–Ω–∏—Ç–∞ –µ–±–∞–Ω–∞—è, —Ç—ã –∂–µ —Å–≤–∏–Ω—å—è –µ–±–∞–Ω–Ω–∞—è –∫–æ—Ç–æ—Ä–∞—è –¥—Ä–æ—á–∏—Ç –º–æ–π —Ö—É–π  //üå¥üçÅ',
'—Ç—ã –±–ª—è–¥—å –ø–æ–Ω–∏–º–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –Ω–∞—Ä—É—à–∏–ª–∞ —Å–≤–æ—é –ø—Å–∏—Ö–∏–∫—É –º–æ–∏–º —Ö—É–µ–º. —è –∂–µ –æ—á–∫–æ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ —Ç–µ—Ä–ø–∏–ª—ã –≤—ã–µ–±—É. —Å–ª—ã—à–∏—à—å —Ç—ã –º–æ–π —Ö—É–π —Å–æ—Å–∏)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –¥–µ–ª–∞–ª–∏ –æ–±–∑–æ—Ä –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏, –µ–±–∞–Ω–Ω—ã–π —Ç—ã –¥–∞—É–Ω?)—Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –≤—ã–µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∫—É  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É –¥–∞ –µ–±–∞–ª–∏ –µ—ë —Ö–æ—Ä–æ—à–æ –∫–æ–Ω—á–µ–Ω–Ω—É—é –ø—Ä–æ—Å—Ç–∏—Ç—É—Ç–∫—É, —Å–ª—ã—à–∏—à—å –ª—è—Ä–≤–∞ –µ–±–∞–Ω–∞—è. —è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –≤—ã–µ–±—É –∏ –≤—ã–∫–∏–Ω—É –Ω–∞ —Ö—É–π. –ø–∞—Ä–∞—à–∞ —Ç—ã –µ–±–∞–Ω–Ω–∞—è)?  //üå¥üçÅ',
'—è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ –≥–∞—Ä–∞–∂–µ –µ–±–∞–ª —Ç–≤–æ–µ–≥–æ –æ—Ç—Ü–∞. —Ç—ã –ø—Ä–æ—Ç—É—Ö—à–∏–π –ø–µ—Ç—É—Ö —Ç–≤–æ—è –º–∞–º–∞—à–∞ –∫—É–∫–∞—Ä–µ–∫–∞–µ—Ç –Ω–∞ –º–æ–π —Ö—É–π —Å–≤–æ–µ–π –ø–∏–∑–¥–æ–π –∫–æ—Ç–æ—Ä—É—é –æ—Ç—å–µ–±—ã–≤–∞—é—Ç –∫–∞–∂–¥—ã–π –¥–µ–Ω—å)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É –ø–æ–∑–æ—Ä–Ω—É—é –≤ —Ä–æ—Ç–∞–Ω, –∫–æ–Ω—á–µ–Ω–∞–Ω—è —Ç—ã –ø–∏–∑–¥–∞–≥–ª–æ—Ç–∫–∞?). —è —Å–≤–æ–∏–º —Ö—É–µ–º —Å–Ω–æ—Å–∏–ª –æ—á–∫–æ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏, —Ç—ã –≥–Ω–∏–ª–æ–µ–±–∫–∞ –µ–±–∞–Ω–Ω–∞—è0  //üå¥üçÅ',
'–º—É–¥–ª–∞–Ω–∫–∞ —Ç—ã –µ–±–∞–Ω–Ω–∞—è. —Ç—ã –±—É–¥–µ—à—å –∫ –º–æ–µ–º—É —Ö—É—é –ª–∏–ø–Ω—É—Ç—å –∫–∞–∫ –∏ –ø–∏–∑–¥–∞ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–∞–µ–±–∞–Ω–Ω–æ–π, —Ç—ã —Ö—É–ª–µ —Ç–∞–∫–æ–π –Ω–∞–µ–±–∞–Ω–Ω—ã–π —Ç–æ –º–æ–∏–º —Ö—É–µ–º. —Ç—ã –µ–±–∞–Ω–Ω—ã–π –º—É–¥–ª–∞–Ω. –≤—Å–µ—Ä–æ–≤–Ω–æ –º–æ–π —Ö—É–π –≤—ã—Ç—Ä–∞—Ö–∞–µ—Ç —Ç–≤–æ—é –º–∞–º–∫—É  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ –ø–∏–∑–∞–¥ –≤—Ç–æ–µ–π –º–∞–º–∞—à–∏ –Ω–∞ –º–æ–π —Ö—É–π –ø—Ä—ã–≥–∞–µ—Ç —Å–ª—ã—à–∏—à—å —Ç—ã –Ω–µ—á–µ—Å—Ç—å –µ–±–∞–Ω–∞–Ω—è. —è —Ç–≤–æ—é –º–∞–º–∞—à—É–≤ —Ä–æ—Ç –Ω–∞–µ–±—ã–≤–∞ –∫–æ–Ω—á–µ–Ω–Ω—ã –π—Ç—ã —á–ª–µ–Ω–æ—Å–æ—Å–æ —Å—É–∫–∞)  //üå¥üçÅ',
'–æ–ø—è—Ç—å –∫–æ–ø–∏—Ä–æ–≤–∞—Ç—å –ø–æ—à–µ–ª –ø–æ –≤—Ç–æ—Ä–æ–º—É –∫—Ä—É–≥—É, –∫–∞–∫ –∏ –ø–∏–∑–¥–∞ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏, –æ—Ç—å–µ–±–∞–Ω—ã–π —Ç—ã –¥–∞—É–Ω. —è –∂–µ –≤—Å–µ—Ä–æ–≤–Ω–æ —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞—Ç—Ä–∞—Ö–∞—é —Å–≤–æ–∏–º —á–ª–µ–Ω–æ–º –µ–±–∞–Ω–Ω–∞—è —Ç—ã –∫—É—Ä–æ–ø–∞—Ç–∫–∞  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –µ–±–∞–Ω–Ω–∞—è –ø–∞—Ä–∞—à–∞ –≤ –∫–æ—Ç–æ—Ä—É—é —è —Å—Å—É. —Å–ª—ã—à–∏—à—å —Ç—ã –≥–∞—Ä–º–æ–Ω—ã–π –ø–µ—Ç—É—Ö, —è –≤—Ç–æ—é –º–∞–º–∞—à—É —á–∏—Å—Ç–æ —Å–ª–ª—å—é –≤—É–Ω–∏—Ç–∞–∑ –∑–∞—Å—É–Ω—É –µ–±–∞–Ω–Ω—É—é –ø–∞—Ä–∞—à—É —Å—É–∫–∞)  //üå¥üçÅ',
