'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –±–æ–ª–µ–µ—Ç —Å–ø–∏–¥–æ–º –µ–±–∞–Ω–Ω–∞—è —Å–æ–±–∞–∫–∞.—è –µ—ë –æ—Ç—Ä–∞—Ö–∞—é –≤ –ø–∏–∑–¥—É —Å–ª—ã—à–∏—à—å —Ç—ã –¥–æ–∫—É–º–µ–Ω—Ç, —Ç–≤–æ—è –º–∞–º–∞—à–∞ –º–Ω–µ –¥–∞–ª–∞ –±—É–º–∞–≥–∏ –ø–æ –∫–æ—Ç–æ—Ä—ã–º —è –º–æ–≥—É —Ç–µ–±—è –≤—ã–µ–±–∞—Ç—å –∫–∞–∫ —Å–æ–±–∞–∫—É  //üå¥üçÅ',
'—Ç—ã –∂–µ –ø—Ä–æ—Å—Ç–æ –∫–æ–≥–¥–∞ —Å–æ –º–Ω–æ–π –æ–±—â–∞–µ—à—å—Å—è —Ç—ã —Å–∏–¥–∏—à—å —É –º–µ–Ω—è –ø–æ–¥ —Å—Ç–æ–ª–æ–º –∏ –ø—ã—Ç–∞–µ—à—å—Å—è —á—Ç–æ-—Ç–æ —Å–∫–∞–∑–∞—Ç—å –≤ —Ç–æ –≤—Ä–µ–º—è –∫–æ–≥–¥–∞ —è —Ç–µ–±—è –µ–±—É –∫–æ–Ω—á–µ–Ω–Ω—É—é –¥—É—Ä–∫—É. —Ç—ã –∂–µ –Ω–∞ —Ö—É–π –º–æ–π —Ö—É–π –ø—Ä—ã–≥–Ω–µ—à—å –∫–∞–∫ –∏ –ø–∏–∑–¥–∞ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ —É —Ç–µ–±—è –±—É–¥–µ—Ç —Ä–æ—Ç –±–æ–ª–µ—Ç—å –ø–æ—Å–ª–µ —Ç–æ–≥–æ –∫–∞–∫ –º–æ–π —Ö—É–π –æ—Ç—å–µ–±–µ—Ç —Ç–µ–±—è –º—É–¥–ª–∏—â–µ —Å—É–∫–∞ –∫–æ–Ω—á–µ–Ω–Ω–æ–π, —Ç–≤–æ—è –º–∞–º–∞—à–∞ —á–∏—Å—Ç–æ –æ—Ç–¥–∞–µ—Ç—Å—è –º–Ω–µ –±–æ—Ç–∞–Ω–∏—á–∫–∞ –µ–±–∞–Ω–Ω–∞—è, —Ç–≤–æ—è –º–∞–º–∞—à–∞ –¥—É—Ä–∞)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –ª–æ–∂–∏—Ç—å—Å—è –Ω–∞ –º–æ–π —Ö—É–π –ø–æ–ª–Ω–æ—Å—Ç—å—é —Å–≤–æ–µ–π –ø–∏–∑–¥–æ–π, —Ç–∞–∫ —Å–∫–∞–∑–∞—Ç—å –ø–æ–∫—Ä—ã–≤–∞–µ—Ç –µ–≥ –æ–µ–±–∞–Ω–∞–Ω—è –¥—É—Ä–∞, —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É –æ—á–∫–∞—Å—Ç—É—é —Å—É–∫–∞ –¥—É—Ä—É, —Ç—ã –∂–µ —Å —Ç—É–ø—ã–º –µ–±–∞–ª–æ–º –æ—Ç–¥–∞—à—å—Å—è –º–æ–µ–º—É —Ö—É—é –∫–∞–∫ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –≤—ã–µ–±–∞–Ω–Ω–∞—è, —Ç—ã –∂–µ –æ–≤—á–∞—Ä–∫–∞ –µ–±–∞–Ω–Ω–∞—è –∫–æ—Ç–æ—Ä–∞—è –Ω–∞ –º–æ–π —Ö—É–π –ø—Ä—ã–≥–∞–µ—Ç, –≤—ã–µ–±–∞–Ω–Ω—ã–π —Ç—ã —Å—É–∫–∞ —á–ª–µ–Ω–æ—Å–æ—Å), —Ç—ã –±—É–¥–µ—à—å –ø–æ–º–æ–≥–∞—Ç—å –º–æ–µ–º—É —Ö—É—é –µ–±–∞—Ç—å –ø–∏–∑–¥—É —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–∞–µ–±–∞–Ω–Ω–æ–π. —Ç—ã –∂–µ –∫–æ–Ω—á–µ–Ω–Ω—ã–π –¥–∞—É–Ω –∫–æ—Ç–æ—Ä–æ–º—É —è –≤ —Ä–æ—Ç –¥–∞—é, —Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –¥–µ–≥–µ–Ω–µ—Ä–∞—Ç–∫–∞ –µ–±–∞–Ω–Ω–∞—è)?  //üå¥üçÅ',
'—Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –ø–µ–ª–∞ —Ä–∞–∑–Ω—ã–µ –ø–µ—Å–Ω–∏ –ø–æ–¥ –º–æ–π —Ö—É–π –µ–±–∞–Ω–Ω–∞—è —Ç—ã –¥—É—Ä–∞ –±–ª—è–¥—å,—è —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ —Ä–æ—Ç –≤—ã–µ–±—É –∫–æ–Ω—á–µ–Ω–Ω–∞—è —Ç—ã —Å–≤–∏–Ω—å—è. —è —á–∏—Å—Ç–æ –¥–æ—Ö—É—è –≤—Ä–µ–º–µ–Ω–∏ —É–¥–µ–ª—è—é –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ –µ–≤—Ä–æ–ø–µ–π–Ω—ã–π —Ç—ã —Ö—É–µ—Å–æ—Å, —è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –ø—Ä–æ—Å—Ç–∏—Ç—É—Ç–∫—É –∫–æ–Ω—á–µ–Ω–Ω—É—é –∑–∞—Ç—Ä–∞—Ö–∞—é)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –∫–æ–Ω—á–Ω–µ–Ω–∞—è —Å–æ—Å–∫–∞ –∫–æ—Ç–æ—Ä—É—é —è –µ–±—É. —Ç—ã –ø–æ–Ω–∏–º–∞–µ—à—å —Ç–æ —á—Ç–æ —è —Ç–≤–æ—é –º–∞–º–∞—à—É –µ–±—É –ø–æ–¥ –∞—Ö—É–µ–Ω–Ω—É—é –º—É–∑—ã–∫—É. –µ–±–∞–Ω–Ω–∞—è —Ç—ã –º–æ—á–∞–ª–∫–∞. –æ—Ç–¥–∞–π—Å—è –º–æ–µ–º—É —Ö—É—é –∫–∞–∫ —Ç–≤–æ—è –º–∞–º–∞—à–∞)  //üå¥üçÅ',
'—è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –æ—Ç—å–µ–±—É, –º–∏–¥–µ—Ä —Ç—ã –∫–æ–Ω—á–µ–Ω–Ω—ã–π. —Ç—ã –±—É–¥–µ—à—å –Ω–∞ –º–æ–µ–º —Ö—É–µ —Å—Ç–æ—è—Ç—å —á—Ç–æ-–±—ã —É —Ç–µ–±—è –Ω–µ —Å—Ç–∏–ª–∏–ª–∏ –∫—Ä–∏–ø–æ–≤ –µ–±–∞–Ω–Ω–∞—è —Ç—ã —à–∞–≤–∫–∞. –º–æ–π —Ö—É–π –ø–æ—Ä–≤–µ—Ç –ø–∏–∑–¥—É —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ –∞–Ω–∞–ª—å–Ω–æ–π. —Ç—ã –∂–µ –µ–±–∞–Ω–Ω—ã–π –∞–Ω–∞–Ω–∞—Å –≤ –∫–æ—Ç–æ—Ä—ã–π —è —Ç—ã–∫–∞—é —Ö—É–µ–º. –µ–±–∞–Ω–Ω–∞—è —à–ª—è–ø–∞ —Ç—ã —Å—É–∫–∞)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—é –º–∞–º–∞—à—É –µ–±–∞–ª–æ —Å—Ç–∞–¥–æ –±—ã–∫–æ–≤ –µ–±–∞–Ω–Ω–∞—è —Ç—ã —á–µ–ª–∫–∞—Å—Ç–∞—è —Ö—É–π–Ω—è)?, —Ç—ã –∂–µ —Ö–∞—á—É–≥–∞ –µ–±–∞–Ω–∞—è, —è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –µ–±–∞–ª –≤–æ –≤—Å–µ—Ö —É–∫—Ä–∞–∏–Ω—Å–∫–∏—Ö –ø–æ–∑–∞—Ö –ø–æ –∫–∞–º–∞—Å—É—Ç—Ä–µ –µ–±–∞–Ω–Ω–∞—è —Ç—ã –±–∏–±–ª–∏—è. —è –ø—Ä–æ—á–∏—Ç–∞–ª —á—Ç–æ —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞–¥–æ –µ–±–∞—Ç—å —Å–∏–ª—å–Ω–æ —Ö—É–µ–º –≤ –∂–æ–ø—É. –¥–∞–≤–∞–π –ø–æ–ø—Ä–æ–±—É–µ—à—å –æ—Ç—Å–æ—Å–∞—Ç—å –º–æ–π —Ö—É–π —Å–æ —Å–≤–æ–µ–π –º–∞–º–∞—à–µ–π –Ω–∞ –ø–∞—Ä—É ,–µ–±–∞–Ω–Ω—ã–µ —Ö—É–µ–≥–ª–æ—Ç—ã)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –ø–æ—Ç—Ä–µ–ø–∞–Ω–Ω–∞—è —à–∞–ª–∞–≤–∞. —Ç—ã –∂–µ –µ–±–∞–Ω–∞—è –º–æ–±–∏–ª–∫–∞ –Ω–∞ –∫–æ—Ç–æ—Ä—É—é —è –∫–æ–ø–∏–ª –º–Ω–æ–≥–æ, –∏ –º–Ω–æ–≥–æ –µ–±–∞–ª —Ç–≤–æ—é –º–∞–º–∞—à—É –∫–æ–Ω—á–Ω–µ—É—é, —Ç—ã –∂–µ –≤—ã–µ–±–∞–Ω–Ω—ã–π —á–µ–ø—É—à–Ω—è–∫–∫—è. –∫–æ–Ω–µ–Ω–Ω–∞—è —Å–≤–∏–Ω—å—è  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç–æ —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É –ø—Ä–æ—Ç—É—Ö—à—É—é —Ö—É—è–º–∏. —Ç—ã –±—É–¥–µ—à—å —Ñ–∞–Ω—Ç–∞–∑–∏—Ä–æ–≤–∞—Ç—å –Ω–∞ –º–æ–µ–º —Ö—É–µ —á—Ç–æ–ª–µ, –µ–±–∞–Ω–Ω—è —Ç—ã –¥—ã—Ä–∫–∞ —Å—É–∫–∞. —Ç—ã –∂–µ –∫—É–≤—à–∏–Ω –µ–±–∞–Ω–Ω—ã–π –≤ –∫–æ—Ç–æ—Ä—ã–π —è —Å—Å—É –µ–±–∞–Ω–Ω–∞—è –º—è–º–ª—è)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É, —Ü–≤–µ—Ç–æ–∫ —Ç—ã —Å—É–∫–∞ –Ω–∞–µ–±–∞–Ω–Ω—ã–π —Ö—É–µ–º. —è—Ç –≤–æ—é –º–∞–º–∞—à—É –ø–æ–¥ –≤–æ–∫–∞–ª –µ–±–∞–ª, –∫–æ–Ω—á–µ–Ω–Ω–∞—è —Ç—ã –ø–ª–æ—â–∞–¥–∫–∞ –¥–ª—è —Ö—É–µ–π. —Ç—ã –≥–ª–∞–≤–Ω–æ–µ –Ω–µ –ø–ª–∞—á—å –∫–æ–≥–¥–∞ –º–æ–π —Ö—É–π –µ–±–µ—Ç —Ç–≤–æ–π –∑–∞—Å—Å–∞–Ω—ã –π—Ä–æ—Ç –æ—Ç—å–µ–±–∞–Ω–Ω—ã–π —Ç—ã –ø–µ—Ç—É—à–µ–∫. —è —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞ –ø–æ–ª—è–Ω–µ –µ–±–∞–ª –≥–Ω–∏–ª—å —Ç—ã –µ–±–∞–Ω–Ω–∞—è)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —á—Ç–æ –º–æ–∏–º —Ö—É–µ–º –µ–±–∞–ª–∏ —Ç–≤–æ—é –º–∞–º–∞—à—É –∏–Ω–≤–∞–ª–∏–¥–∫—É –µ–±–∞–Ω–Ω—É—é, —ã—Ç —Ö–æ—á–µ—à—å —á—Ç–æ-–±—ã –º–æ–π —Ö—É–π –±—ã–ª –ø–æ–º–µ—à–∞–ª –Ω–∞ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏, —Å–ª—ã—à–∏—à—å —Ö–∞—á –±–µ–∞–Ω–Ω—ã–π. —Ç—ã –∂–µ —Å–æ—Å–æ–∫ –∫–æ–Ω—á–µ–Ω–Ω—ã–π –∫–æ—Ç–æ—Ä—ã–π —è –≤—ã–¥–µ—Ä–Ω—É –≤—Å –ø–∏–∑–¥—ã —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏, —Ç—ã –∑–∞–µ–±–∞–Ω–Ω—ã–π –∫–ª–∏—Ç–æ—Ä –º–∞—Ç—å —Ç–≤–æ—è —à–∞–ª–∞–≤–∞)  //üå¥üçÅ',
'—è —Ç–≤–æ—é –º–∞–º–∞—à—É –µ–±–∞–ª —Å –∞—Ö—É–µ–Ω–Ω—ã–º–∏ —Ç–≤–æ–∏–º–∏ –∫–æ–æ—Ä–µ—à–∞–º–∏ –∫–æ—Ç–æ—Ä—ã–µ –ø–æ–¥–¥–µ—Ä–∂–∏–≤–∞–ª–∏ –º–æ–π —Ö—É–π –≤ –ø–∏–∑–¥–µ —Ç–≤–æ–µ–π –º–∞–º–∞—à–∏ –∫–æ–Ω—á–µ–Ω–Ω–æ–π, —Ç—ã –∂–µ –ø–æ–Ω–∏–º–∞–µ—à—å —Ç –æ—á—Ç–æ —Ç—ã —Å–æ–±–∞–∫–∞ //üå¥üçÅ',
'–∫–æ–Ω—á–µ–Ω–Ω–∞—è –∫–æ—Ç–æ—Ä–∞—è –º–æ–π —Ö—É–π —Ç—É—à–∏—Ç –≤ –ø–∏–∑–¥–µ —Å–≤–æ–µ–π –º–∞–º–∞—à–∏. —Ç—ã —Ñ–∞–Ω–∞—Ä—å –µ–±–∞–Ω–Ω—ã–π, —è —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ —Ä–æ—Ç –≤—ã–µ–±—É –ø–æ–Ω–∏–º–∞–µ—à—å –µ–±–∞–Ω–Ω—ã–π –ø–µ–µ—Ç—É—Ö?)  //üå¥üçÅ',
'—Ç—ã –∑–Ω–∞–µ—à—å —Ç –æ—á—Ç–æ —Ç–≤–æ—è –º–∞–º–∞—à–∞ –Ω–µ –≤—ã–≤–æ–∑–∏—Ç –º–æ–π —Ö—É–π –æ–æ–¥–Ω–∞. —Ç—ã —ç–π –ø–æ–º–æ–≥–∞–µ—à—å –µ–±–∞–Ω–Ω–æ–π —à–≤–∞–±—Ä–µ. –ø–∏–∑–¥–∞ —Ç–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –Ω–∞ –º–æ–µ–º —Ö—É–µ –ø–æ–º–µ—à–∞–Ω–Ω–∞—è, —Ç—ã –∂–µ –≤—ã–µ–±–∞–Ω–Ω—ã–π –µ–≤–Ω—É—Ö –∫–æ—Ç–æ—Ä–æ–º—É —è –¥–∞—é –≤ —Ä–æ—Ç–∞–Ω. —Ç—ã –∂–µ –Ω–∞–µ–±–∞–Ω–Ω—ã–π –º–æ–∏–º —Ö—É–µ–º –µ–≤—Ä–µ–π. —Ç–≤–æ—è –º–∞–º–∞—à–∞ —á–∏—Å—Ç –æ–æ—Ç–¥–∞–ª–∞—Å—å –º–æ–µ–º—É —Ö—É—é –∫–∞–∫ —Å–æ–±–∞–∫–∞ –µ–±–∞–Ω–∞–Ω—è, —Ç—ã –∂–µ –∑–∞–µ–±–∞–Ω–Ω—ã–π –µ–≤–Ω—É—Ö –≤ –ø–∏–∑–¥—É, —è —Ç–≤–æ—é –º–∞–º–∞—à—É –Ω–∞ –æ—Å—Ç–∞–Ω–æ–≤–∫–µ –µ–±—É –µ–±–∞–Ω–Ω–∞—è —Ç—ã –≥–∞–Ω–¥–æ–Ω–∫–∞ —Å—É–∫–∞)  //üå¥üçÅ',
'—Ç—ã –Ω–∞ —Ö—É–π —Å–≤–æ–∏ —Ñ–µ–π–ª—ã –∑–∞—Å—É–Ω—å –≤ –ø–∏–∑–¥—É —Å–≤–æ–µ–π –º–∞–º–∞—à–∏ —Ç—É–¥–∞-–∂–µ –≥–¥–µ –º–æ–π —Ö—É–π –æ—Ä—É–¥—É–µ—Ç, —Å–ª—ã—à–∏—à—å —à–º–∞—Ä–∞ –µ–±–∞–Ω–Ω–∞—è, —Ç–µ–±–µ –∂–∞—Ä–∫–æ —Å –º–æ–∏–º —Ö—É–µ–º —á—Ç–æ–ª–µ –æ—Ç—å–µ–±–∞–Ω–Ω—ã –π–¥–∞—É–Ω. —è –∂–µ —Ç–≤–æ—é –º–∞–º–∞—à—É –≤ –ª–µ—Å—É —Ç—Ä–∞—Ö–Ω—É –ª–µ—Å–æ—Ä—É–±–∫—É –∫–æ–Ω—á–µ–Ω–Ω—É, —Ç—ã –±—É–¥–µ—à—å —É—Å–ø–æ–∫–∞–∏–≤–∞—Ç—å –ø–∏–∑–¥—É —Å–≤–æ–µ–π –º–∞—Ç–µ—Ä–∏ –º–æ–∏–º —Ö—É–µ–º —á—Ç–æ–ª–µ –µ–±–∞–Ω–Ω–∞—è —Ç—ã –≥–∞–≤–Ω–∞—Ä—å–∫–∞?)  //üå¥üçÅ',
